(41, 1610000107, 'ttshow/channel/41/Profile/profile.jpg', 'ttshow/channel/41/cover.jpg', '演員', '', '頑GAME', '2013 入圍YouTube台灣年度十大喜劇。\n2014 網路實境節目《戀愛不設線》獲得YouTube年度最佳合作無間獎。\n2014 YouTube 100,000訂閱大賞獎牌\n2015 第一季台灣YouTube 最成功廣告排行 第五名', 'playthreesmallgame', 'none', '[{"name":"頑Game粉絲團","url":"https://www.facebook.com/playthreesmallgame"},{"name":"聖結石粉絲團","url":"https://www.facebook.com/ShenJieShiSaint"},{"name":"華森粉絲團","url":"https://www.facebook.com/Hanksmkinghw"},{"name":"鐵牛粉絲團","url":"https://www.facebook.com/55555Family"}]', '[{"name":"頑GAME頻道","url":"UCizhMTp9vKkpdcbqVLdDmdA"},{"name":"頑GAME Life 頻道","url":"UCFtzNF15v-mI6ZgoC28mlTA"}]', '[{"name":"聖結石IG","url":"qoop1113"}]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-23 12:26:41', '', 'true'),
