(49, 160, 'ttshow/channel/49/Profile/profile.jpg', 'ttshow/channel/49/cover.jpg', '', '', '狗與鹿', '網路人氣插畫「狗與鹿」作者James，曾經養了一隻17年的柴犬，擅長用筆刻畫寵物與主人之間感人互動，簡單的幾句話和圖像創作充滿「洋蔥」，總是受到網友廣大迴響，狗與鹿創作題材來自自身養寵經驗，再把感人語錄結合圖像喚起人們愛寵之心，身受年輕族群及愛狗人士的喜愛。', 'MYDEERDOG', '', '[{"name":"facebook","url":"https://www.facebook.com/MYDEERDOG"}]', '[]', '[{"name":"Instagram","url":"mydeerdog"}]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-27 04:11:43', '', 'true'),
