(51, 156, 'ttshow/channel/51/Profile/profile.jpg', 'ttshow/channel/51/cover.jpg', '', '', '耍花招', '走溫暖路線的插畫家，透過將一朵俏皮的花擬人化，化身成耍花招自己本身，更是個充滿正能量的可愛幸福人妻，抱持著人生就是要開心的想法，帶給身邊的人更多的溫暖與開心正能量。', 'littleflower4710', '', '[{"name":"耍花招","url":"https://www.facebook.com/littleflower4710"}]', '[]', '[{"name":"littleflower4710","url":"https://instagram.com/littleflower4710"}]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-28 05:41:29', '', 'true'),
