(88, 1610000177, 'ttshow/channel/88/Profile/profile.png', 'ttshow/channel/88/cover.png', '', '', '有熊氏x有熊事', '網路人氣插畫家有熊氏X有熊事過去的作品曾創下單周觸及人數超過150萬人次，因擔任高雄氣爆義工而啟發創作動力，也是高雄市經發局及多間企業合作的插畫家。代表作為「麥當勞日常生活」，貼近服務業心聲，表達最真實的服務人員心境。', 'ubear4', '', '[{"name":"有熊氏x有熊事","url":"https://www.facebook.com/ubear4"}]', '[]', '[{"name":"Instagram","url":"https://instagram.com/ubearthing/"}]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-29 07:32:53', '', 'true'),
(64, 1610000120, 'ttshow/channel/64/Profile/profile.jpg', 'ttshow/channel/64/cover.jpg', '插畫家', '', 'MasterFey廢大獅', '易怒、懶散、愛妻 ♥\n\n如需合作請洽：\n0982882101 \nMasterFey@Outlook.com', 'MasterFey', '', '[]', '[]', '[]', '[]', '[]', '[]', '', '', '', '', '', '', '2015-05-28 09:35:56', '', 'true'),
(74, 1610000164, 'ttshow/channel/74/Profile/profile.png', 'ttshow/channel/74/cover.jpg', '', '', 'onion man', 'Onion man 洋蔥 剛從大學畢業的大學生，洋蔥的人物角色是以國小同學為原型塑造，創作題材來自生活上的人事物，擅長發揮幽默有趣的梗為創作特色。以搞笑動畫《鄧紫棋-黑鳳梨》在網路上走紅，洋蔥打算以後朝著專職的插畫家發展，讓大家看到他更多的作品。', 'onionman', '', '[]', '[]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-28 14:38:29', '', 'true'),
(75, 1610000136, 'ttshow/channel/75/Profile/profile.jpg', 'ttshow/channel/75/cover.jpg', '', '', 'Egg Things', 'Egg Thing作品主要以諧音梗、屁孩行為和嘴賤為創作特色，粉絲專頁成立一年多累積超過30萬粉絲，蛋哥抱持著「人不屁孩枉少年」的態度，讓畫出來的東西能讓自己、粉絲們看了都會心一笑。', 'eggthings', '', '[{"name":"facebook","url":"https://www.facebook.com/eggthings"}]', '[]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-28 15:02:49', '', 'true'),
(86, 1610000175, 'ttshow/channel/86/Profile/profile.jpg', 'ttshow/channel/86/cover.jpg', '', '', '矮小菡生活圖文', '情侶系圖文作家，擅長描繪小情侶間的互動，帶你重回青澀時代，重溫初戀心跳加速的感動', 'han320', '', '[{"name":"矮小菡生活圖文","url":"https://www.facebook.com/han0320"}]', '[]', '[{"name":"矮小菡生活圖文","url":"ai.xiao.han"}]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-29 06:37:22', '', 'true'),
(174, 163, 'ttshow/channel/174/Profile/profile.png', 'ttshow/channel/174/cover.jpg', '', '', '鹿人', '鹿人創作風格獨特且具印象，每個人物擁有強壯的腹肌，他是由一對可愛俏皮情侶組成， 男朋友是主要負責畫圖，女朋友就負責上色跟制止他畫一些太18禁的題材，以防粉絲專頁不小心被停權。', 'twodeerman', '', '[]', '[]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-10-23 03:10:51', '', 'true'),
(175, 163, 'ttshow/channel/175/Profile/profile.jpg', 'ttshow/channel/175/cover.jpg', '', '', '啾啾妹 by LIIN', '任性女友最佳代言人，讓男友又愛又恨的啾啾妹，作品貼近生活又甜蜜，總讓人會心一笑', 'chuchumei.byLIIN', '', '[]', '[]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-10-23 03:13:05', '', 'true'),
(94, 1610000176, 'ttshow/channel/94/Profile/profile.jpg', 'ttshow/channel/94/cover.jpg', '', '', 'Abow 阿寶', '現實世界裡的童話啟示，也是男女戀愛的插畫家，網路經典梗圖製造機。', 'AbowArt', '', '[]', '[]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-05-29 13:16:45', '', 'true'),
