(126, 1610000106, 'ttshow/channel/126/Profile/profile.jpg', '', '插畫家', '', 'Lon-設計是空', '世界上最遙遠的距離，不是天和地...而是我說了一個很好笑的笑話，妳卻聽不懂', 'londesign', '', '[{"name":"Lon-設計是空","url":"https://www.facebook.com/londesign"}]', '[]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-07-20 06:09:32', '', 'true'),
