(137, 1610000107, 'ttshow/channel/137/Profile/profile.jpg', 'ttshow/channel/137/cover.jpg', '官方', '', 'STEPHEN BAKERY', '大家好我是林昶均 / STEPHEN\n可以叫我布朗尼先生唷\n在這會看到所有做蛋糕 / 生活的點滴\n工作邀約請洽\n(02)2370-3758 超人氣娛樂', 'StephenBakery', 'none', '[{"name":"facebook粉絲團連結","url":"https://www.facebook.com/StephenBakery"}]', '[{"name":" STEPHEN BAKERY","url":"UCwPkxSYCN2DZXy4TVHacJTw"}]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-07-31 07:22:28', '', 'true'),
(138, 1610000107, 'ttshow/channel/138/Profile/profile.jpg', 'ttshow/channel/138/cover.jpg', '', '', '筆是港女 Eagle', '我是依糕，希望和大家做好朋友❤\n\n【商業合作】超人氣娛樂\n新媒體行銷顧問：Karen\n\n聯絡電話(02)2370-3758 分機122\n聯絡手機 0930-545-111\nkaren.chuang@ttshow.tw', 'EagleYingBase', 'none', '[{"name":"facebook粉絲團連結","url":"https://www.facebook.com/EagleYingBase"}]', '[{"name":"筆是港女-Eagle","url":"UCkMJNtbGkvsuXCyvcEe0bZw"}]', '[{"name":"Instagram","url":"eagle_ying"}]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-07-31 07:25:59', '', 'true'),
