(140, 1610000226, 'ttshow/channel/140/Profile/profile.jpg', 'ttshow/channel/140/cover.jpg', '演員', '', '花式街頭籃球之王 -- 小夫', '台灣第一位開始推動花式街頭籃球運動的人-小夫\n我的夢想是把花式街頭籃球運動發揚光大，做成像美國職籃NBA一樣大的運動產業，我不知道會不會成功，但我會很努力，堅持到最後 !!!', 'MASTERstreetball', 'none', '[{"name":"facebook","url":"https://www.facebook.com/MASTERstreetball"}]', '[{"name":"關於花式街頭籃球之王 -- 小夫","url":"UC2z4SA9CYBqcnfzStHWsXTA"}]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-07-31 07:56:09', '', 'true'),
(141, 1610000226, 'ttshow/channel/141/Profile/profile.jpg', 'ttshow/channel/141/cover.jpg', '演員', '', '柯基犬のCoffee Time', '這是一隻養在遊戲店科基犬COFFEE的成長物語，標誌是肥肥嘴邊肉與6歲小孩般聰明的智力，可以認得一堆玩具名字、人名、狗名、甚至是地名，也經常上電視節目或新聞喔。', 'CorgiCoffeeTime', 'none', '[{"name":"facebook","url":"https://www.facebook.com/CorgiCoffeeTime"}]', '[{"name":"柯基犬のCoffee Time","url":"UCb1qpwAgcFM4CRv4n9uwkJQ"}]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-07-31 08:00:25', '', 'true'),
(143, 1610000227, 'ttshow/channel/143/Profile/profile.jpg', 'ttshow/channel/143/cover.jpg', '插畫家', '', '焦曉凡fanfan', '我是焦曉凡fanfan♥\n想把喜歡的事物跟生活趣事做成影片就生出這個頻道♥♥\n焦你用我的方式吃喝玩樂希望你們會喜歡 yeah♥♥♥\n', 'fanfan81914', 'none', '[{"name":"facebook","url":"https://www.facebook.com/fanfan81914/timeline"}]', '[{"name":"焦曉凡fanfan","url":"UCjqAuT-giO8fjQqnNl1dDUw"}]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-07-31 08:14:17', '', 'true'),
(144, 1610000227, 'ttshow/channel/144/Profile/profile.jpg', 'ttshow/channel/144/cover.jpg', '插畫家', '', 'Migo米果-李欣怡', 'Hello我是Migo 米果\n喜歡旅行、創作：）', 'hellomigo', 'none', '[{"name":"facebook","url":"https://www.facebook.com/hellomigo/timeline"}]', '[{"name":"米果-MIGO","url":"UC2t4o9NH-j_cmDCCWwQ2RDQ"}]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-07-31 09:32:29', '', 'true'),
(146, 163, 'ttshow/channel/146/Profile/profile.jpg', 'ttshow/channel/146/cover.jpg', '', '', '姊妹星時代 my star sis', '姊妹星時代My star sis\n是 源鑛娛樂 與 超人氣娛樂 合作的頻道\n由王思佳,布蘭妮,王俐人,依依佩佩合力製作與演出\n陸續推出:\n《布蘭妮到底想怎樣》-網路爆笑劇\n《私家街頭實驗室》-實境秀節目\n《婚紗店沒說的事》-流行時尚節目\n《新手媽媽的OS》-婆媳狀況劇\n《美悧人生》-生活美容節目\n未來將有更多作品陸續推出，歡迎訂閱本頻道', 'my-star-sis', 'none', '[{"name":"facebook","url":"https://www.facebook.com/343784302412654"}]', '[{"name":"姊妹星時代 my star sis","url":"UCi7ficiRVVvZzdoSkdi4xcg"}]', '[]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-08-03 08:09:06', '', 'true'),
(147, 1610000226, 'ttshow/channel/147/Profile/profile.jpg', 'ttshow/channel/147/cover.png', '', '', '崩井 Soulswell', '我只想用文字陪伴偶爾寂寞失落的人。<br>\n專頁：<a href="https://www.facebook.com/soulswell" target="_blank">https://www.facebook.com/soulswell</a><br>\n基督徒。Yahoo! Style、真愛機專欄作家。情發於中，就是我寫作的理由。<br>\n著有散文集《從此，我們不再是我們》、《我們總是無法好好說再見》<br>', 'soulswell', 'none', '[{"name":"崩井 Soulswell 專頁","url":"https://www.facebook.com/soulswell"}]', '[]', '[{"name":"崩井","url":"soulswell"}]', '[]', '[]', '[]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-08-03 08:25:31', '', 'true'),
(148, 1610000132, 'ttshow/channel/148/Profile/profile.jpg', 'ttshow/channel/148/cover.jpg', '', '', '小嘴愛畫畫', '都會女性代言人，女性粉絲高達八成，都是喜愛小嘴犀利性感又不做作的圖文。不管是在職場或感情中小嘴總是能說出她們心裡的話。', 'littlemouth', '', '[{"name":"小嘴愛畫畫","url":"https://www.facebook.com/littlemouth"}]', '[]', '[{"name":"小嘴","url":"http://instagram.com/littlemouth_/"}]', '[]', '[]', '["a","a"]', 'all', 'true', 'true', 'true', 'all', 'all', '2015-08-03 08:58:32', '', 'true'),
