INSERT INTO `page` (`page_id`, `user_id`, `special_tag_id`, `checker_id`, `channel_id`, `display`, `photo_list`, `movie_list`, `article_icon`, `c_num_click`, `share_num`, `class`, `tag`, `title`, `describe`, `appraisal`, `html`, `date`) VALUES
(1742, 163, 0, 0, 134, 'none', '{"0":"20150731170332905081.jpg"}', '{}', 'pagicon.jpg', 159, 2, 2, '["真愛橋","感情","愛情"]', '他說愛妳卻一直嫌妳，因為他愛的是他自己！ | 真愛橋【感情】', '', 0, '<center><p><img class="alignleft" style="max-width: 100%;" src="image_0.jpg" alt="" img_index="0"></p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">Mrs.L 一直對於愛情的觀念是</p><p style="text-align: left;">兩個人在一起最好能夠常相廝守</p><p style="text-align: left;">而彼此要是對方最好的朋友、家人</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">完全無法忍受另一伴只是用來陪自己吃飯看電影打炮用的</p><p style="text-align: left;">可是現在，我們卻眼睜睜看著這些勉為其難的愛情上演</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">我知道那些孤單感讓我們很難放手</p><p style="text-align: left;">即使心裡都明白，早就不如以往了</p><p style="text-align: left;">甚至對方的偷吃或冷淡，妳已經以淚洗面好久了</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">可是放手，好難好可怕</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">會不會自己誤會了</p><p style="text-align: left;">會不會兩個人還有機會復原</p><p style="text-align: left;">會不會失去他了，就再也沒辦法愛了</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">女孩，只要妳願意</p><p style="text-align: left;">更好的愛會在妳準備好之時出現的</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">但在這之前</p><p style="text-align: left;">我們必須要先知道</p><p style="text-align: left;">到底為什麼兩個人會走到怎樣都不對勁這一步</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">有時候，只是妳沒有看清楚</p><p style="text-align: left;">他愛的自始至終，都是他自己</p><p style="text-align: left;">妳會發現他總是會嫌不完妳的缺點</p><p style="text-align: left;">即使他偶爾稱讚了妳，讓妳欣喜不已</p><p style="text-align: left;">但是他總可以用「為妳好」的開頭，要妳哪裡改進</p><p style="text-align: left;">奇怪的是，那些妳的不好</p><p style="text-align: left;">一直都不是妳最大的問題啊</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">在網路上看到一篇提問</p><p style="text-align: left;">男孩一開始認識女孩就是透過介紹認識</p><p style="text-align: left;">前言沒有看出男孩對這個女孩有更多的認識或是說明</p><p style="text-align: left;">只說了因為剛好沒有合適的對象</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">這裡說明了，他根本也不是真的多喜歡這女生</p><p style="text-align: left;">但是他卻願意和他不太喜歡的人在一起</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">我以為在一起是一件非常重要的事</p><p style="text-align: left;">怎麼現在變得如此輕易？</p><p style="text-align: left;">買鞋子都還要考慮一下，看看合不合腳、價格能不能負擔、顏色好搭配嗎？</p><p style="text-align: left;">女朋友卻連鞋子都不如了，「有總比沒有好」，是嗎？</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">他沒有多加敘述女友的部分或是交往的經過</p><p style="text-align: left;">例如：「認識她之後，發現她的個性活潑，我們很聊得來。」</p><p style="text-align: left;">就直接切入了正題，他帶去給朋友看了</p><p style="text-align: left;">朋友用了不好聽的形容詞說他的女朋友，讓他很生氣</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">嗯，生氣朋友怎麼可以這樣說自己的女朋友嗎？</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">不是。</p><p style="text-align: left;">他是覺得很丟臉，但是又回不了話</p><p style="text-align: left;">因為他真的覺得女朋友「有點肉」</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">他覺得他的「配件」被嫌不好看了</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">就像買的喬登鞋，被朋友笑說這雙最少人買了欸</p><p style="text-align: left;">你怎麼會挑這雙，這雙很醜耶！</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">大概是這個心情</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">然後他回頭審視了自己的女朋友</p><p style="text-align: left;">要求女朋友開始運動，他發現女朋友都沒有運動習慣</p><p style="text-align: left;">可是他自己有，所以他覺得這樣的要求很理所當然</p><p style="text-align: left;">特別女朋友本來身材條件就不夠好了</p><p style="text-align: left;">生活習慣也不好</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">恩，有運動習慣似乎對身心都不錯</p><p style="text-align: left;">但是我相信很多人一輩子不運動也過得很好</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">至於健康不健康，就像不抽菸的人也會得肺癌</p><p style="text-align: left;">她不喜歡運動，也不是什麼太嚴重的事情吧</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">而男生自己有運動習慣，他希望影響並帶起女生的興趣</p><p style="text-align: left;">那為什麼不是他跟著女朋友一起看韓劇呢？</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">誰說看韓劇就一定不好，運動就一定會是好</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">好或不好，我覺得或許有一個大眾化的印象</p><p style="text-align: left;">但這都是個人意志啊！</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">況且男生只是因為被朋友糗了覺得丟臉</p><p style="text-align: left;">就要求女生改變，甚至說不改變就乾脆分手了</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">我如果是那女生，我也希望快點分手吧</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">男生根本不是真的為了她好</p><p style="text-align: left;">而是為了自己的面子</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">或許妳在他眼裡大概是剛好及格了</p><p style="text-align: left;">湊巧他又覺得交個女朋友也不錯，那就試試看吧</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">可是因為認識的不夠深不夠多</p><p style="text-align: left;">交往之後就開始加分與扣分</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">可惜一開始他就把妳分數打得不高</p><p style="text-align: left;">很容易就不及格了</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">他就開始嫌棄妳</p><p style="text-align: left;">不再對妳付出更多感情</p><p style="text-align: left;">勉強盡了男朋友的責任</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">他覺得「至少我沒有偷吃就是沒有錯啊！」</p><p style="text-align: left;">但愛情怎麼能夠這樣擺爛呢？</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">讀書也不是翻過課本就叫有看書啊</p><p style="text-align: left;">沒有人希望自己的真心被敷衍了事</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">這時候很多女孩</p><p style="text-align: left;">就因為對方盡了某些男朋友的責任</p><p style="text-align: left;">心軟而委屈自己</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">一再配合改變</p><p style="text-align: left;">卻只是換來更多的冷淡與忽略</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">妳總是騙自己</p><p style="text-align: left;">他只是太忙，他只是太累，我們還可以努力</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">可是他就是連約會都懶了</p><p style="text-align: left;">他不再會想著要見到妳了</p><p style="text-align: left;">他見到妳連話都懶得說了</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">對，他是沒有犯什麼滔天大錯</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">你們誰都沒有所謂的對錯</p><p style="text-align: left;">只是勉強在一起，為了有一個「男/女朋友」，有意義嗎？</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">捨不得，妳到底捨不得的是他已經退去的愛情</p><p style="text-align: left;">還是捨不得自己又得回歸單身，不知道何時在有個固定的對象</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">「固定的對象」</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">不要讓愛情變得如此廉價</p><p style="text-align: left;">他如果連朋友的陪伴都給的吝嗇了</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">妳自己愛自己都還幸福得多</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">想說什麼，就來這裡找我吧</p><p style="text-align: left;">Mrs.L 好攝戀人&nbsp; <a href="https://www.facebook.com/IamMrs.Lola">https://www.facebook.com/IamMrs.Lola</a><br> <br> 文章來源：真愛橋 <a href="http://ichangego.net/article/734/">http://ichangego.net/article/734/</a></p><p style="text-align: left;">【本文由 <strong><span style="color: #0000ff;">真愛橋</span></strong>&nbsp;合作授權，未經同意請勿任意轉載】</p></center>', '2015-07-31 17:03:32'),
(1728, 163, 0, 0, 171, '', '{"0":"2015102309300647691.jpg","1":"2015102309300649068.jpg","2":"2015102309300649992.jpg","3":"2015102309300650871.jpg","4":"2015102309300651803.jpg","5":"2015102309300652576.jpg"}', '{}', 'pagicon.jpg', 462, 0, 46, '["狗與鹿","寵物","插畫家"]', '催淚圖文創作「狗與鹿」 描繪寵物與主人的深刻情感', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" img_index="0"></p><p>James，網路人氣插畫「狗與鹿」作者，曾經養了一隻17年的柴犬，擅長用筆刻畫寵物與主人之間感人互動，簡單的幾句話和圖像創作充滿「洋蔥」，總是受到網友廣大迴響，狗與鹿創作題材來自自身養寵經驗，再把感人語錄結合圖像喚起人們愛寵之心，身受年輕族群及愛狗人士的喜愛。</p><p>狗與鹿的創作風格俐落可愛，沒有豐富的色彩、但有濃厚的情感，強調人與狗的相處之道，James說自己並不是一位插畫家，而是圖文創作者，他希望透過這些創作讓人們能更珍惜與寵物之間的情感，並熱心參與公益活動幫助弱勢寵物發聲。</p><p><img class="aligncenter" style="max-width: 100%;" src="image_1.jpg" alt="" img_index="1"><br><br>(圖／狗與鹿 facebook粉絲團)</p><p>&nbsp;</p><p><strong>臉書發跡 快速爆紅</strong></p><p>James是超人氣娛樂公司第一位簽約插畫家，執行長黃冠融發掘狗與鹿的特色，感受到創作中的情感，兩人又對於插畫行銷的理念相同，在這競爭相當激烈的插畫領域想要熬出頭必須互借專長，狗與鹿接受「台灣達人秀」社群平台提供的許多曝光支援，粉絲團成立短短半年就突破26萬人按讚，每周貼文觸及數達200萬人，快速地達到James的插畫事業目標。</p><p><img class="aligncenter" style="max-width: 100%;" src="image_2.jpg" alt="" img_index="2"><br>(圖／狗與鹿 Instagram)</p><p>&nbsp;</p><p><strong>善用自身社群影響力</strong></p><p>主題定位鮮明，狗與鹿擁有大量死忠粉絲的關注，每篇貼文總是引發共鳴，吸引上萬讚，為了提升粉絲黏著度，James不僅張貼個人創作，也時常分享寵物相關文章、新聞與影片，抓住粉絲的喜好，產生更多的興趣互動，他讓粉絲也共同分享照顧毛小孩的大小事，粉絲也常常在創作留言分享自身的照片，這不僅是James實現夢想的地方，同時也是毛孩愛好者的同好聚落。</p><p>&nbsp;</p><p><strong>狗與鹿作者James訪問</strong></p><p><strong>Q: 請問為何開始畫圖呢?</strong> <br>A: 當初是想畫我跟女朋友每天生活碰到的好氣又好笑的事情，紀錄男女之間相處的點點滴滴，又想要畫掰掰啾啾跟馬來貘那種很有個性又隨興賤賤的東西，但是太多人畫了，有特色、畫功好的超多人，所以覺得必須畫些很有獨特性又沒有人畫過的東西。</p><p>&nbsp;</p><p><strong>Q: 狗與鹿的圖文創作中總能傳達出許多主人與毛小孩間的情感，你是如何開始這樣的創作方向？</strong><br>A:一開始真的什麼都畫，冷梗、道理、中肯、搞笑、耍賤的，全部都畫過，畫了幾篇之後，發現從小到大的笑話梗都用完了，沒梗了，突然有一個朋友在FB貼了一張幫自己的狗撿大便很無奈的心情，我看到了就把它畫下來，那篇叫做「執子之手，與子偕老，執子之手，撿屎到老」，當時粉絲人數兩千多人，讚數居然可以有一千多，比當時畫的任何一篇都高出好幾倍，這讓我有一點感覺到原來一張簡單的手部動作，配上一段文字，有這麼強大的威力。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_3.jpg" alt="" img_index="3"></p><p><strong>Q: 創作中有沒有遭遇到什麼困難與瓶頸，如何從中做突破與成長?</strong><br>A:從一開始畫狗與鹿，一直會覺得我的筆觸不夠好，我的畫風不成熟，我的主角沒特色，我的色彩不夠多，我的幽默感沒人懂，我的構圖太複雜……等等一堆，因為我一直拿現在最厲害的幾個大咖當作假想敵，怎麼樣都覺得要超越他們比登天還難，越這樣想就越挫折。</p><p>畫了兩個月之後，粉絲人數大約三千多，每天以一百人左右成長，這中間畫狗畫寵物的比例也變多了一點，從開始擔心會沒有梗，到每天硬擠都要擠出來兩篇，我發現畫得越多，好跟壞的圖就越快分辨出來，也越知道我自己喜歡的跟粉絲反應熱烈的怎麼做取捨。</p><p>&nbsp;</p><p><strong>Q: 在經營粉絲團過程中，有沒有什麼特別的方法與經驗可以跟讀者們分享？</strong><br>A: 自己常常會去看前輩作品，例如HH先生的專訪，說粉絲專頁開始第一天就有八千多人按讚，我畫了兩個月才三千多人，會覺得灰心，也會懷疑自己，心急之下就開始一些奇怪的拉讚方式，看後台有誰一直按讚的，就私訊他，拜託他分享我幾篇圖，有一些成效，但是效果不大，而且覺得這樣有點不要臉，好像在硬推銷。</p><p>後來又發現如果抓準大咖PO文時間，然後立刻改原圖補圖在留言，會突然吸引一些粉絲近來，像是掰掰啾啾，救客人，A RAY ，我都常常會觀察他們的PO文時間，然後補圖，但是效果也是一下下，而且吸引來的，是他的族群，不是我的。<br>又持續畫了半個月，突然有個靈感畫了一篇「世界沒變是你變了」，很簡單的剪刀石頭布，但是對象是狗的手掌，當天的PO文時間，比平常晚，之前都是晚上七點多到八點，而這篇是九點多PO的，反應超好，這又讓我學到一課，原來好的梗，碰上對的時間點，效果是兩倍到三倍的驚人!</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_4.jpg" alt="" width="640" height="100%" img_index="4"></p><p><strong>Q:有沒有什麼樣的創作心法，分享給也正在經營粉絲團的朋友們?</strong><br>A:遇到瓶頸，那就把瓶子打破！<br>其實每一陣子，應該說每隔幾天，就會遇到瓶頸，總是想要超越自己前一篇的讚數，總是想要感動更多人，總是想要把我想說的，讓更多人了解，會心一笑，但是梗用完了，擠不出來就是擠不出來，每天到了九點要PO文，八點半都還在抓頭髮，哀哀叫說沒有想法怎麼辦，除了看書、看電影、看歌詞、觀察身邊的人事物，還有什麼能一直刺激我的靈感呢? 到現在都還沒有一個答案，我還是常常遇到瓶頸，但是久而久之，前面幾個月的經驗告訴我，隨便畫，不要有得失心，偶然之作，必有知音，我就沒有太在意了，一直畫就好!</p><p>&nbsp;</p><p><strong>Q: 創作之外，在經營策略上有下過哪些功夫?</strong><br>A: 自從Duncan design、馬來貘、掰掰啾啾爆紅之後，台灣的插畫人如雨後春筍般地冒出來，越來越多人只要一支筆，一個笑話，就是一個插畫人，一個粉絲專頁，想要在這眾多的畫家當中突破，難上加難，在我三千多人粉絲的時候遇到了超人氣娛樂的執行長King ，聊了很多插畫的行銷、操作，也學到了很多東西，我發現單打獨鬥實在太累太難了，就算有很好的作品，在畫家暴增的環境中也很難出頭。勢必要藉由一個人氣很旺的平台來發聲，才能夠有快速竄紅的機會，就像是一個很會唱歌的人，在學校的司令台唱歌，跟站在白宮對著全世界唱歌，能見度、討論度、爭議性，一定是相當懸殊的! 所以我選擇好好地跟懂得操作、人氣旺的平台合作，以求最快達到我的插畫事業目標 !</p><p>&nbsp;</p><p><strong>Q: 走上插畫這條路以來,最讓你感動的或難忘的經驗是什麼?</strong><br>A: 一開始畫插畫是希望讓大家笑，但是後來發現我比較會畫哭的，但是哭，並不是一種負能量，我覺得是一種釋放，是一種放下，是學習成長，是反省，是讓自己更能把握當下的動力，也因為這樣，聽到網友跟我說因為我的畫，他從悲傷絕望中走出來，讓我很有動力，覺得我在做一件超有意義的事情，也讓我更確定這會是我一輩子都要做的有意義的事業!!</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_5.jpg" alt="" img_index="5"></p><p><strong>Q: 對於新書的出版,你有沒有什麼樣的心路歷程</strong><br>A:在2014年底開始與出本社聯絡開始出書的準備，因為版面有限但是想收錄的作品太多，所以在取捨上面掙扎了很有，最後聽編輯的話，以故事主題來分類，所以收錄近來的作品也是精挑細選出來的。(好難割捨)</p><p>有一天收好東西把電腦也收好準備出門，突然被狗撞了一下，包包從椅子上掉下來，電腦小小摔了一下，以為還好，結果就開不了機了，檢查之後確定是硬碟壞掉!!!!!! 出書的檔案全部在裡面，救援了兩次花了一萬多，才用一種高深到我不懂的技術就出了80%的資料，但是也因為這樣，因為前後畫風有轉變過，也把比較早期的作品做了翻新，讓整本書的呈現比較統一，比較是最貼近現在的感覺。就是這個感覺，一個不小心，事情就會發生，跟你預期的一定不一樣，所以更要好好珍惜把握任何我們有的東西!</p><p>書裡面的新作品”說好的一輩子”，是看愛因斯坦的相對論想到的，其實不太懂相對論，只是平常很愛看這類的文章，只知道它在講時間、空間、重量、距離、速度，簡單說就是有可能像太空旅行一樣，時空的兩邊，一邊過了一天，另一邊已經過了十年，這觀念對我來說衝擊很大，我就把它畫進狗與鹿裡面，讓大家能夠珍惜現在的美好時光。</p><p>&nbsp;</p><p>狗與鹿粉絲團：https://www.facebook.com/MYDEERDOG<br>Instagram：https://instagram.com/mydeerdog/</p><p>&nbsp;</p><p>【關於狗與鹿】<br>成立日期：2014/07/28<br>現職：狗與鹿粉絲團創作者、愛毛孩寵物資訊服務網專欄作家<br>經歷：流浪動物花園協會、妞新聞合作Take Me Home插畫展</p>', '2015-08-06 14:47:47'),
