(1503, 1610000107, 0, 0, 125, 'none', '{"0":"20150722175347508460.jpg","1":"20150722175347511230.jpg","2":"20150722175347513014.png","3":"20150722175347516894.jpg","4":"20150722175347532434.jpg","5":"20150722175347534175.jpg","6":"20150722175347546023.jpg","7":"20150722175347561595.png"}', '{}', 'pagicon.png', 32, 0, 7, '["柴犬","Mikho","脊椎異常","坐姿","寵物","有趣","日本"]', '網路爆紅的盤腿坐柴犬，背後的故事令人鼻酸 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true"> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.jpg" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"></p><p><strong>▲網上流傳的這張柴犬如大爺般一屁股坐的照片時在可愛極了，像是模仿人在耍大牌似的，但其實這個坐姿的背後原因卻令人不捨（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></p><p></p><p>這隻日本柴犬Mikho的逗趣坐姿照片一被上放網路即迅速竄紅，一開始，主人也不知道為什麼Mikho會偏好這種奇怪的坐法，直到後來發現他許多的動作都顯得怪怪的不自然，才在他四個月大帶他去給獸醫檢查，結果原來是因為Mikho的脊椎有先天的異常，表面上看起來無俚頭的動作，背後潛藏著後腿麻痹失調的隱憂。</p><p></p><p>雖然可以動手術治療，但醫生說手術成功率低於10%，於是Mikho的爸媽決定先讓他使用專屬輪椅以支撐後腿。所幸，後來聽說給位西班牙的醫師動刀，康復率有50%，他們因此開始在網路上將Mikho的故事分享出去，希望透過募款方式來籌措跨海動手術所需的龐大費用。</p><p></p>\n                 \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.jpg" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"><strong>▲小時候的他無憂無慮地抱著玩偶呼呼大睡<strong>（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></strong></p>\n                 \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"><strong>▲這種泰迪熊似的坐法就像是隻假的絨毛玩偶<strong>（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></strong></p>\n                 \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.jpg" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"><strong>▲X光檢查下發現脊椎的異常導致他的日常生活動作甚至是走路都異於一般狗狗<strong>（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></strong></p>\n                 \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_4.jpg" img_index="4"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"><strong>▲有時Mikho還會交疊雙腳坐著像個淑女般，網友直呼被萌翻了…但不幸的是，若有問題脊椎繼續壓迫神經，最終可能導致他的後腿癱瘓<strong>（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></strong><br></p>\n                 \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_5.jpg" img_index="5"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"><strong>▲Mikho有一對非常愛他的爸媽，他們寫下Mikho的故事放到網路上進行募款望能早日讓他進行手術<strong>（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></strong><br></p>\n                 \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_6.jpg" img_index="6"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"><strong>▲Mikho媽媽特別做了一件背後藏有一片金屬板子的矯正衣給他，讓他穿上時能挺胸以減緩脊椎的壓迫，Mikho看起來十分帥氣！<strong>（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></strong></p>\n                 \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_7.png" img_index="7"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                \n                            <p contenteditable="false"><strong>▲約定好了！一定要快點好起來繼續當爸媽的開心果<strong>（圖／<a href="https://instagram.com/shiba_mikho/" target="_blank">Shiba Mikho -Instagram</a>）</strong></strong></p>\n                <p>來源：http://www.ettoday.net/news/20150622/524093.htm</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:53:47'),
