(242, 1610000107, 0, 0, 41, 'none', 'null', '{"0":"//www.youtube.com/embed/38kLrBsilT0"}', 'pagicon.jpg', 9, 0, 2, '["頑GAME","華森","聖結石","鐵牛(老伍)","搞笑綜藝","娛樂","生活","KTV","攝影 張育豪","製片 祐謙","剪接後製 軒志"]', '《頑Talk No5》KTV都會遇到的事【頑GAME】', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                                        <div class="youtobe_video" style="">\n                                            <div style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none" class="col-md-12 col-xs-12 col-lg-12 col-md-12" name="u2_player">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe src="//www.youtube.com/embed/38kLrBsilT0" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe>\n                                            </div>\n                                        </div>\n                                </div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-05-26 18:02:28'),
(1744, 163, 0, 0, 134, 'none', '{"0":"20150731172310218487.jpg","1":"20150731172310224356.jpg","2":"20150731172310228120.jpg","3":"20150731172310231798.jpg","4":"20150731172310240817.jpg","5":"20150731172310256579.jpg","6":"20150731172310258220.jpg"}', '{}', 'pagicon.jpg', 53, 0, 2, '["真愛橋","感情","愛情"]', '男人，做到這6點，證明你擁有了女人們夢幻的可靠的雙肩！ | 真愛橋【感情】', '', 0, '<center><p style="text-align: left;">&nbsp;<img style="max-width: 100%;" src="image_0.jpg" alt="" img_index="0"></p><p style="text-align: left;">男人，做到這6點，你就擁有了女人們夢幻的可靠雙肩！</p><p style="text-align: left;">可靠的肩膀，對女人來說，是相當重要的！</p><p style="text-align: left;">肩膀溫暖的男人，無形之中就是存在著一種安全感。</p><p style="text-align: left;">好像心理受了什麼委屈事，都知道自己還有個後盾在支持她。</p><p style="text-align: left;">愛情中，有些舉動是男人們應該要注意的！</p><p style="text-align: left;">一旦你做到了這些，對女人來說，你就擁有了她們夢幻的可靠雙肩！</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">1/&nbsp; 愛屋及烏</p><p style="text-align: left;"><img style="max-width: 100%;" src="image_1.jpg" alt="" img_index="1"></p><p style="text-align: left;">愛她，在自己能力所及的範圍內，</p><p style="text-align: left;">試著對他的家人好、朋友好。</p><p style="text-align: left;">就算只是一些簡單的關心問候都比漠不關心溫暖許多。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">2/&nbsp; 學著偶爾當個妻奴</p><p style="text-align: left;"><img style="max-width: 100%;" src="image_2.jpg" alt="" img_index="2"></p><p style="text-align: left;">在她需要照顧時，給她無比溫暖的呵護。</p><p style="text-align: left;">女人要的不是你無時無刻的服侍，</p><p style="text-align: left;">而是在她們需要你時，你能出現。</p><p style="text-align: left;">平時的相處也應該用珍惜、愛惜的心態對待這份愛情。</p><p style="text-align: left;">妻奴，其實是對男人的最高讚美。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">3/&nbsp; 強勢，但請記得尊重！</p><p style="text-align: left;"><img style="max-width: 100%;" src="image_3.jpg" alt="" img_index="3"></p><p style="text-align: left;">很多人認為成熟的男人就應該要強勢點，</p><p style="text-align: left;">適時的強勢當然可以，但請記得尊重女生。</p><p style="text-align: left;">尊重對方的感受與想法，比盲目的主觀主導愛情，更重要！&nbsp;</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">4/&nbsp; 專注，但是記得哄哄她！</p><p style="text-align: left;"><img style="max-width: 100%;" src="image_4.jpg" alt="" img_index="4"></p><p style="text-align: left;">試著專注在一件事上，不管是工作、興趣都可以。</p><p style="text-align: left;">讓女生看到你對一件事的專注程度，</p><p style="text-align: left;">女生會很容易為之著迷的！</p><p style="text-align: left;">但專注之餘，記得哄哄她、陪陪她喔！</p><p style="text-align: left;">讓她知道，在你心中，仍有那個她的無可取代位置。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">5/&nbsp; 讓她做她想做的事，但適時的保護她！</p><p style="text-align: left;"><img style="max-width: 100%;" src="image_5.jpg" alt="" img_index="5"></p><p style="text-align: left;">過多的限制與規定，對女人來說，會覺得你相當厭煩。</p><p style="text-align: left;">如果她想做什麼、嘗試什麼，只要不要太誇張，就讓她去試試吧！</p><p style="text-align: left;">但適時的請記得保護她。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">6/&nbsp; 在她徬徨時，肯定她、給予理性的意見。</p><p style="text-align: left;"><img style="max-width: 100%;" src="image_6.jpg" alt="" img_index="6"></p><p style="text-align: left;">女生普遍比較感性。</p><p style="text-align: left;">有時可能會被是情所困惑，感到無助、徬徨。</p><p style="text-align: left;">而這時，你一定要先肯定她，http://ichangego.net/</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">讓她知道你的溫暖擁抱就在她背後。</p><p style="text-align: left;">接著用你的理性，給予她有幫助的意見吧！</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">試著用女生喜歡的方式，去對她好吧！</p><p style="text-align: left;">兩人的相愛，將因為彼此的成長，而變得更適合彼此。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">同場加映/&nbsp; 肩膀最可靠星座男vs.最需要溫暖肩膀的星座女！<a href="http://ichangego.net/article/449/">http://ichangego.net/article/449/</a><br> 同場加映/&nbsp; 『好男友』不會做的5+1件事！<a href="http://ichangego.net/article/204/">http://ichangego.net/article/204/</a><br> <br> 文章來源：真愛橋&nbsp; http://ichangego.net/article/506/</p><p style="text-align: left;">【本文由 <strong><span style="color: #0000ff;">真愛橋</span></strong>&nbsp;合作授權，未經同意請勿任意轉載】</p></center>', '2015-07-31 17:23:10'),
