(1544, 1610000107, 0, 0, 125, 'none', '{"0":"20150722175358518092.png","1":"20150722175358518980.png","2":"20150722175358519585.png","3":"20150722175358520098.png","4":"20150722175358520639.png","5":"20150722175358521156.png"}', '{"0":"//www.youtube.com/embed/NGSvuI-g1JA"}', 'pagicon.png', 5, 0, 7, '["寵物","寵物聯萌","貓咪","抱抱"]', '貓咪愛撒嬌 主人黏不停 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                            <p contenteditable="false"><b>比起愛黏人的狗狗，喵星人們通常很有個性，常常是把主人當僕人用，不屑一顧愛理不理的，但是當貓貓們卸下冷酷高傲的姿態主動要求抱抱時，你拒絕的了嗎?&nbsp;</b></p>\n                <p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_0.png" width="600" img_index="0"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p>\n                            <p contenteditable="false">▲把主人當健身器材用之「隨便吧！你愛抱就抱，我來可以來順便拉個筋」</p>\n                <p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_1.png" width="600" img_index="1"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p>\n                            <p contenteditable="false"><b>▲</b>被貓星人撲倒…不妙了，整個人淪陷無法動彈</p>\n                <p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_2.png" width="600" img_index="2"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p>\n                            <p contenteditable="false">▲「好了拉~爸比，你知道我最愛你了，快點幫我準備晚餐吧~」</p>\n                <p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_3.png" width="600" img_index="3"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p>\n                            <p contenteditable="false"><b>▲</b>再10分鐘…再讓我睡10分鐘就好！</p>\n                <p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_4.png" width="600" img_index="4"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p>\n                            <p contenteditable="false">▲「抓到你了，地球人，成為我的奴隸吧！」</p>\n                <p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_5.png" width="600" img_index="5"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p>\n                            <p contenteditable="false"><b>▲</b>主人覺得我在說「抱我~抱我~我要抱抱~」，其實我在說「那個碗裡有什麼，給我~給我~快給我！」</p>\n                \n                            <p contenteditable="false">沒想到貓星人們也可以如此有愛，平時主人做牛做馬都值得了(淚)。慵懶的貓咪們有時還是會主動示好撒嬌、裝可愛想引起主人關注的，不過貓爸爸貓媽媽們應該都發現了吧，其實自己已經是被貓星人征服的寵物了…ㄎㄎㄎ</p>\n                \n                                        <div style="" class="youtobe_video">\n                                            <div name="u2_player" class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/NGSvuI-g1JA"></iframe>\n                                            </div>\n                                        </div>\n                                </div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:53:58'),
