(2057, 161, 0, 0, 49, '', '{"0":"20151029113623581679.jpg","1":"20151029113623583609.jpg","2":"20151029113623584813.jpg","3":"20151029113623585945.jpg","4":"20151029113623586943.jpg","5":"20151029113623587955.jpg"}', '{}', 'pagicon.jpg', 18, 0, 4, '["插畫家","插畫精選","狗與鹿","感人與溫馨","與狗狗的生活"]', '【狗與鹿】插畫精選(八)：小時候的夢想', '', 0, '<p style="text-align: center;">1.小時候的夢想</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0">&nbsp;</p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.你認命吧你</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1">&nbsp;</p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">3.小狗與小孩</p><p style="text-align: center;">&nbsp;<img style="max-width: 100%;" src="image_2.jpg" alt="" width="399" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.你給牠的，永遠是最好的</p><p style="text-align: center;">&nbsp;<img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.哎呀!小心!</p><p style="text-align: center;">&nbsp;<img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">6.人有人的權力，狗也有狗狗的權力。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5">&nbsp;</p>', '2015-10-26 13:48:09'),
(2058, 161, 0, 0, 51, '', '{}', '{}', 'pagicon.jpg', 24, 0, 4, '["插畫家","插畫精選","耍花招","人生觀","愛情"]', '【耍花招】插畫精選(四)：考試零分與滿分', '', 0, '<p style="text-align: center;">1.考試零分與滿分</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/2015102615024051567.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.我討厭你</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026150240174206.jpg" alt="" width="401" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.車鑰匙在哪?</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026150240261131.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.難過之後，要馬上振作起來才行!</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/2015102615024014100.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.任性的幸福</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/201510261502406610.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.人生就是如此</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026150239973335.jpg" alt="" width="401" height="100%" data-pos="page"></p>', '2015-10-26 14:09:40'),
(1689, 1610000107, 0, 0, 125, 'none', '{"0":"20150722175407630283.png","1":"20150722175407631063.png","2":"20150722175407634551.png","3":"20150722175407638093.jpg","4":"20150722175407638681.png","5":"20150722175407642351.png"}', '{}', 'pagicon.png', 3, 0, 7, '["寵物聯萌","巴哥犬","肺炎","寵物"]', '這是隻史上最小的巴哥犬，小到可以擺在桌上當公仔 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                    <p>這隻在英國出生四個月大的巴哥犬無疑當之無愧為最療癒的「桌面擺飾」。</p>\n<p>Pip出生時因為唇顎裂引起肺炎，但小傢伙幸運地從活下來，除了size比一般犬小外，獸醫說他的身體狀況一切正常，他現在體重約1磅，身長4英吋，跟他同時出生的其他兄弟姊妹比起來足足小了一半。</p><p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img src="image_0.png" style="width: 100%; max-width: 100%;" key="img" mmid="1" width="426" img_index="0"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p><p style="text-align: center;">▲Pip的媽媽是隻正常大小的巴哥犬</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲捧在手心上剛剛好</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲Pip像一般小狗一樣愛玩好動</p><p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_3.jpg" width="426" img_index="3"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p><p style="text-align: center;">▲不動時就像是個做工精緻的擺飾品一樣</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_4.png" img_index="4"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲ 主人說帶Pip出門時都必須小心地將他放在手提袋中外出</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_5.png" img_index="5"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false" style="text-align: center;">▲路人紛紛不敢相信他是隻活生生的狗，因為他「就像個玩具」</p><p>來源：<span><a href="http://www.buzzfeed.com/richardhjames/this-pug-owner-reckons-their-pet-could-be-one-of-the-smalles#.thdB5BDJ7" target="_blank">buzzfeed.com</a></span></p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:54:07'),
(2021, 161, 0, 0, 64, '', '{"0":"20151029094959595104.jpg","1":"20151029095000406626.jpg","2":"20151029095001210501.jpg","3":"20151029095001762036.jpg","4":"20151029095001763331.jpg","5":"20151029095001764320.jpg"}', '{}', 'pagicon.jpg', 23, 0, 4, '["Master Fey 廢大獅","插畫精選","插畫家","生活","友情"]', '【廢大獅】插畫精選(七)：學些的某些同學...', '', 0, '<p style="text-align: center;">&nbsp;1.學些的某些同學</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.休假爽睡</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="401" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.兔子對大獅的了解</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.吃飯很快的朋友</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.恐怖的中秋節大戰</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.對號入座的朋友</p><p style="text-align: center;">&nbsp;<img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5"></p>', '2015-10-23 13:19:44'),
(2038, 161, 0, 0, 148, '', '{"0":"2015102911045390918.jpg","1":"2015102911045393251.jpg","2":"2015102911045394523.jpg","3":"2015102911045396182.jpg","4":"2015102911045398024.jpg","5":"2015102911045399404.jpg"}', '{}', 'pagicon.jpg', 13, 0, 4, '["小嘴愛畫畫","插畫家","愛情","插畫精選","兩性關係"]', '【小嘴愛畫畫】插畫精選(四)：捏肚子', '', 0, '<p style="text-align: center;">&nbsp;1.捏肚子</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.濕了</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.不要哭了</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.體貼的行為</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.兩個人的早晨</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.不要給她胡思亂想的機會</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5">&nbsp;</p>', '2015-10-26 09:21:35'),
(1921, 161, 0, 0, 120, '', '{"0":"20151029104738734324.png","1":"20151029104738736699.png","2":"20151029104738737757.png","3":"20151029104738738752.png","4":"20151029104738739779.png","5":"20151029104738740800.png"}', '{}', 'pagicon.jpg', 26, 0, 4, '["三隻熊Mr.D","插畫家","插畫精選","冷笑話","愛情"]', '【三隻熊Mr.D】插畫精選(一)：交往前…你所做的題目是？', '', 0, '<p style="text-align: center;">1.每一題都需要細心作答</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.png" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.愛情的脆弱</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.png" alt="" width="349" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.心動與心定</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.png" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.請別棄養自己身邊的小寶貝。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.png" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">5.釋迦也有種族之分</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.png" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.分手與復合之後的稱呼</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.png" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 15:21:50'),
(1967, 163, 0, 0, 34, 'none', '{"0":"20151021155350663301.jpg","1":"20151021155350665776.jpg","2":"20151021155350666924.jpg","3":"20151021155350668511.jpg"}', '{}', 'pagicon.jpg', 83, 0, 2, '["我的少女時代","12星座","Wackyboys","搞笑","熱門影音"]', '12星座之我的少女時代篇—幫妳解析你身旁的徐太宇！', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" img_index="0"></p><p><img style="max-width: 100%;" src="image_1.jpg" alt="" img_index="1"></p><p><strong>▲由Wackyboys成員孫生飾演男主角，還將各星座個性演得十分到位爆笑。&nbsp;&nbsp;(圖/擷取自影片)</strong></p><p><strong><span style="color: #ff0000;">『每個女孩子的心中，都有一個徐太宇』。</span></strong></p><p>近日網路上出現一部搞笑十二星座，主題除了惡搞電影「我的少女時代」，參考部分原電影中的劇情，同時還將各十二星座不同的說話方式、行為穿插進影片內容中，像是巨蟹座天生愛照顧他人的個性、處女座喜歡吹毛求疵神經兮兮…等，用誇張的方式詮釋各十二星座男個性之外，內容也有趣的讓人不禁莞爾一笑！</p><p><img style="max-width: 100%;" src="image_2.jpg" alt="" img_index="2"></p><p><strong>▲</strong>圖為描述牡羊的直接不愛拐彎抹角，動作既誇張又搞笑。 &nbsp;&nbsp;(圖/擷取自影片)</p><p><img style="max-width: 100%;" src="image_3.jpg" alt="" img_index="3"></p><p><strong>▲</strong><strong>也描寫到摩羯偶爾的固執常讓人氣到崩潰。 &nbsp;&nbsp;(圖/擷取自影片)</strong></p><p>想要了解<span style="text-decoration: underline;"><strong>自己身邊的徐太宇</strong></span>是屬於哪種類型的人嗎？快點進影片中觀賞吧！</p><p>&nbsp;</p><p><span style="color: #3366ff;">各十二星座概述如下：</span></p><ul><li><p><span style="color: #3366ff;">射手座—愛交朋友是天性</span></p></li><li><p><span style="color: #3366ff;">巨蟹座—天生喜歡照顧人</span></p></li><li><p><span style="color: #3366ff;">摩羯座—固執難以溝通</span></p></li><li><p><span style="color: #3366ff;">金牛座—懂得精打細算</span></p></li><li><p><span style="color: #3366ff;">雙子座—伶俐且善變</span></p></li><li><p><span style="color: #3366ff;">水瓶座—外表堅強內心脆弱</span></p></li><li><p><span style="color: #3366ff;">天秤座—優柔寡斷無法抉擇</span></p></li><li><p><span style="color: #3366ff;">雙魚座—浪漫愛幻想</span></p></li><li><p><span style="color: #3366ff;">處女座—吹毛求疵神經兮兮</span></p></li><li><p><span style="color: #3366ff;">天蠍座—佔有慾超強</span></p></li><li><p><span style="color: #3366ff;">獅子座—以自我為中心</span></p></li><li style="text-align: left;"><p><span style="color: #3366ff;">牡羊座—直接不喜歡拐彎抹角</span></p