(722, 1610000107, 0, 0, 113, 'none', '{}', '{"0":"//www.youtube.com/embed/YkfConi6WVc"}', 'pagicon.jpg', 18, 0, 2, '["藝拍集合 EG Studio","林大晉","安娜‧李","阿傑","眼鏡","冠瑋","摳摳哥-阿雄","老大","小強","仲村絢香(梨梨亞)","林匯喬","程涼","奧山邦之","KUSO電影","KANO"]', '「KANO」續集 KUSO版 KANO 2 Parody「藝拍集合EG STUDIO」', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                                        <div class="youtobe_video" style="">\n                                            <div style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none" class="col-md-12 col-xs-12 col-lg-12 col-md-12" name="u2_player">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe src="//www.youtube.com/embed/YkfConi6WVc" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe>\n                                            </div>\n                                        </div>\n                                </div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-06-08 17:13:46'),
(1745, 163, 0, 0, 134, 'none', '{"0":"20150731172631413842.jpg"}', '{}', 'pagicon.jpg', 134, 0, 2, '["真愛橋","感情","愛情"]', '做愛的爽快，讓人忘了愛情 | 真愛橋【感情】', '', 0, '<center><p><img class="alignleft" style="max-width: 100%;" src="image_0.jpg" alt="" img_index="0"></p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　凌晨四點多，女孩打給我，哭著說了什麼我聽的不是很清楚，在確定了她的位置後，我套件外套就出了門。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　坐在晚間國小的司令台邊上，女孩開始邊哭邊說著今晚發生的事情，簡言之，就是所謂的捉姦在床，男人追上去說著抱歉、說他最愛的還是女孩、說了這只是一時的意亂情迷，他只是喝多了等等諸如此類的……嗯，藉口。女孩問我，她該不該原諒男人？畢竟兩人都在一起五年了，我沒有正面回答她的問題，因為人有時候在向他人提問時，其實內心深處已經有了答案，而提問的目的，也只是希望那答案能得到肯定罷了，所以我也只問了：「你想原諒嗎？」女孩說：「我不知道。」</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　每個人對待愛情的方式不同，其愛情面貌也有百百種，就像我，對我來說，背叛就是背叛了，在一起時，我會給予對方全部的信任，但我的信任就只有一次，沒了就沒了，或許，在某一種程度上，我算是有感情潔癖的人，有些東西髒了就是髒了，即使再愛，我寧可狠狠的把他從我的心上挖掉，也不會要了。但是女孩不是我，我們不能要求對方用跟我們一樣的方式，去對待他們的愛情，因為沒有人可以去為誰的心情負責，所以我也沒有辦法去命令女孩在她還離不開時，去勉強自己離開。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　親愛的，你們都要記得，別人所給予的言語，都只能是建議，而不能讓它成為你的決定，因為沒有人能為你們的心情或心痛負責。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　記得我曾經很直接的跟朋友這麼描述過：「就算有女人跨坐在男人身上，即使男人硬了，他也可以選擇不放進去，不過是看他怎麼選擇罷了。既然選擇了，無論結果如何，你已沒有了後悔的資格。」也曾有男人這麼回過我說：「男人似乎總是要在經過（幾次）翻船，才能了解到，什麼對他們來說才是最重要的。」是不是總要在失去後，才能懂得愛情的深刻？人們總說，「不要在失去後才懂得後悔、才懂得珍惜」，這道理誰都聽過，但又有多少人真的將這句話放進心裡了？</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　做愛的爽快，讓人忘了愛情，再多的理由，也無非只是藉口，因為你始終是做了選擇。女孩用眼淚面對你的背叛，證明了她的深愛。</p></center><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">&nbsp;</p><center><p style="text-align: left;">同場加映：<a href="http://ichangego.net/article/153/">有多少愛可以重來？</a><br><br> 文章來源：真愛橋 http://ichangego.net/article/373/</p><p style="text-align: left;">【本文由 <strong><span style="color: #0000ff;">真愛橋</span></strong>&nbsp;合作授權，未經同意請勿任意轉載】</p></center>', '2015-07-31 17:26:31'),
(1746, 163, 0, 0, 134, 'none', '{"0":"20150804155357363934.jpg"}', '{}', 'pagicon.jpg', 1427, 23, 2, '["真愛橋","感情","愛情","星座"]', '最疼愛另一半的星座男女！ | 真愛橋【感情】', '', 0, '<center><p><img class="alignleft" style="max-width: 100%;" src="image_0.jpg" alt="" img_index="0"></p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">最疼愛另一半的星座男女！</p><p style="text-align: left;">當熱戀褪去，“疼愛彼此”是維持戀情的一個小秘訣。</p><p style="text-align: left;">兩人間的相處，也能因為彼此的疼惜更加甜蜜唷！</p><p style="text-align: left;">對於疼愛另一半，你又做到了多少？</p><p style="text-align: left;">讓我們公布最疼愛另一半的星座女孩吧！</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;"><br><span style="color: #ff6600;"><strong>No.3 |金牛女|</strong></span></p><p style="text-align: left;">金牛女在感情世界中，總是較單純。</p><p style="text-align: left;">雖然有時候表現的古靈精怪、深不可測，但其實她們沒有你想的那麼複雜。</p><p style="text-align: left;">金牛女是疼愛男友的！</p><p style="text-align: left;">她們相當在意男友說的事，只要男友的一句“想她”，她可以馬上排除萬難到對方身邊。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;"><strong><span style="color: #ff6600;">No.2 |雙魚女|</span></strong></p><p style="text-align: left;">雙魚女們對男有相當體貼、關心，兩人的相處上，她也總是相當有耐心。</p><p style="text-align: left;">但是天生愛幻想的個性，讓她們容易變得敏感、多疑。</p><p style="text-align: left;">一旦對方有一個小舉動不對勁，她們就會開始亂想，甚至變得感傷、落寞。</p><p style="text-align: left;">因為害怕失去，所以她們往往會對另一半相當好！</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;"><span style="color: #ff6600;"><strong>No.1 |天秤女|</strong></span></p><p style="text-align: left;">天秤女們對男友的好，已經有點接近寵愛了！</p><p style="text-align: left;">她們會聽男友的話，只要不是太誇張的事，她們都會選擇勉強自己來配合對方。</p><p style="text-align: left;">但其實，她們內心是脆弱的，所以喜歡依賴男友、特別疼愛男友。</p><p style="text-align: left;">受到女友疼愛的男生，真的相當幸福～</p></center><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">&nbsp;</p><center><p style="text-align: left;">那麼，哪些星座男友一樣也會疼愛女友呢？</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;"><span style="color: #ff6600;"><strong>No.3 |雙魚男|</strong></span></p><p style="text-align: left;">一旦被雙魚男看上的女孩，他們會將自己的一切都給對方。</p><p style="text-align: left;">為了得到心愛人的心，他們什麼都願意付出。</p><p style="text-align: left;">就算相處上看到了對方的缺點，他們也會選擇包容。</p><p style="text-align: left;">她們疼愛女友的方式，是相當細心的百般呵護！</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;"><span style="color: #ff6600;"><strong>No.2 |牡羊男|</strong></span></p><p style="text-align: left;">牡羊男天生就是大男人主義，在他們心中，女生就應該被自己保護。</p><p style="text-align: left;">在任何情況下，他們都會選擇不和女人計較。</p><p style="text-align: left;">對方一開口，只要是他們能力所及，一定會答應對方</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;"><span style="color: #ff6600;"><strong>No.1 |處女男|</strong></span></p><p style="text-align: left;">如果另一半是處女男，那麼恭喜妳！！！</p><p style="text-align: left;">處女男完全就是女生童話故事中的白馬王子！</p><p style="text-align: left;">和處女男談戀愛，女生可以整天像是活在童話故事中一樣，每天都有不同的浪漫、驚喜。</p></center><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">&nbsp;</p><center><p style="text-align: left;">文章來源：真愛橋&nbsp; http://ichangego.net/article/399/</p><p style="text-align: left;">想要疼愛另一半，可以從製造驚喜開始唷！http://ichangego.net/article/192/</p></center><center><p style="text-align: left;">【本文由 <strong><span style="color: #0000ff;">真愛橋</span></strong>&nbsp;合作授權，未經同意請勿任意轉載】</p></center>', '2015-08-04 15:53:57'),
(1743, 163, 0, 0, 134, 'none', '{"0":"20150731173423927301.jpg"}', '{}', 'pagicon.jpg', 51, 2, 2, '["真愛橋","感情","愛情"]', '有多少愛可以重來？ | 真愛橋【感情】', '', 0, '<center><p style="text-align: left;"><img style="max-width: 100%;" src="image_0.jpg" alt="" img_index="0"></p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　也許是因為我們曾經太過年輕，對待感情太一廂情願；也或許是因為距離、因為誤會、因為我們的不夠成熟，不知道該如何去維繫一段感情、不知道自己要的到底是什麼，最後，我們失去了一段情，選擇了分開。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　歲月流去，誰沒有過滄桑？流年輾轉，只因為當時年少。耗去了年華、看透了風景，思想成熟了，也終於知道了自己在追尋的是什麼。匆匆過去多少年後的偶然相見，始終是在心裡起了波瀾。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　的確，破鏡重圓，但裂痕仍會在，重拾的感情，也不會是當初的模樣。但是舊的人，卻可以新的開始，不過前提是，你們當初分開的理由，不能是因為＂背叛＂。愛情包含了真誠，它需要將些許的自由作為代價，寂寞或者誘惑等都不能成為背叛的理由。因為當一段感情，「有了」或「有過」欺騙，儘管後來包裹的真心是如何的真，但你已無法像當初那樣去全然地信任對方，那這段感情又如何能長久呢？甚至會因為猜忌，而將那殘存在心底的美好部份，都予以打碎。順帶一提，若當初離開的原由並非是因為不愛了，那儘管只是殘留在心底的一點點放不下，都可以讓重新開始的機會隨之增高。</p><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">　　命運的迂迴捉弄，仍躲不過那冥冥之中，時間讓我們懂了愛，也懂得了珍惜，我們變成了更好的自己。「眾裏尋他千百度，驀然回首，那人卻在燈火闌珊處」，暫時的分開，也許是為了更好的在一起。</p></center><p style="text-align: left;">&nbsp;</p><p style="text-align: left;">&nbsp;</p><center><p style="text-align: left;">文章來源：真愛橋 http://ichangego.net/article/153/</p><p style="text-align: left;">【本文由 <strong><span style="color: #0000ff;">真愛橋</span></strong>&nbsp;合作授權，未經同意請勿任意轉載】</p></center>', '2015-07-31 17:34:23'),
