(1841, 1610000237, 0, 0, 138, 'none', '{}', '{"0":"https://www.youtube.com/embed/2dkh8l2xsBE"}', 'pagicon.jpg', 37, 1, 2, '[]', '依糕雙手畫：心聲', '', 0, '<p>有沒有試過，<br>因為要面子說不出口，<br>於是錯過了一些人......</p><p>&nbsp;</p><p><div class="youtobe_video"><iframe style="max-width:100%;" width="560" height="315" src="https://www.youtube.com/embed/2dkh8l2xsBE" frameborder="0" allowfullscreen=""></iframe></div></p>', '2015-08-04 19:14:35'),
(1846, 1610000231, 0, 0, 149, 'none', '{}', '{"0":"https://www.youtube.com/embed/ZHpfTR_W5Gg"}', 'pagicon.jpg', 39, 0, 2, '["我是安安","趣味","朋友","搞笑"]', '身邊似乎都有這樣的朋友▕ 我是安安【趣味】', '', 0, '<p><span style="font-size: 36pt; color: #ff6600;">多少都會有這類型的朋友吧！？　XD</span></p><p><div class="youtobe_video"><iframe style="max-width:100%;" width="830" height="467" src="https://www.youtube.com/embed/ZHpfTR_W5Gg" frameborder="0" allowfullscreen=""></iframe></div></p>', '2015-08-05 12:27:38'),
(1843, 163, 0, 0, 128, 'none', '{"0":"20151012112145908093.png"}', '{"0":"https://www.youtube.com/embed/QIkz9-HFkHc","1":"https://www.youtube.com/embed/f_bRGsuJdNM","2":"https://www.youtube.com/embed/dbPO6JxkNaA"}', 'pagicon.jpg', 3209, 167, 2, '["卡片","手作","情人卡","萬用卡","百葉窗卡"]', '百葉窗卡教學| 和雅菲一起做卡片【手作】 ', '', 0, '<p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/QIkz9-HFkHc" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>可愛又有趣的百葉窗卡！</p><p>選兩張喜歡的照片或圖片，用電腦排版在A4版面上，彩印出來</p><p><img style="max-width: 100%;" src="image_0.png" alt="" img_index="0"></p><p>然後跟著雅菲一起一步一步完成百葉窗卡！！</p><p>&nbsp;</p><p>✪材料：</p><p>➝兩組照片或圖片：一組前圖(兩張)、一組後圖(兩張)，四張照片尺寸相同。</p><p>&nbsp; &nbsp; 影片中照片為6.8*8公分，可依需求做調整。</p><p>&nbsp; &nbsp; 彩印時選用厚一點的紙質(便利商店選用特殊紙、影印店選用象牙紙）</p><p>➝兩張12*12公分的正方形紙卡(如果做比影片大或小的照片，紙卡的尺寸要再自行調整)</p><p>➝一張4*17.5公分長方形紙卡(如果做比影片大或小的照片，紙卡的尺寸要再自行調整)</p><p>&nbsp;</p><p>✪工具：</p><p>➝剪刀或刀片、白膠、尺、筆</p><p>&nbsp;</p><p>這邊還有更可愛的百葉窗卡喔！❤</p><p>&nbsp;</p><p>', '2015-08-05 12:42:00'),
(1899, 163, 0, 0, 171, '', '{"0":"20151023102225742711.jpg","1":"20151023102225744393.jpg","2":"20151023102225745741.jpg","3":"20151023102225746612.jpg","4":"20151023102225747302.jpg","5":"20151023102225748124.jpg","6":"20151023102225748931.jpg","7":"20151023102225749620.jpg","8":"20151023102225750387.jpg","9":"20151023102225751159.jpg","10":"20151023102225751866.jpg","11":"20151023102225752659.jpg","12":"20151023102225753479.jpg","13":"20151023102225754239.jpg"}', '{}', 'pagicon.jpg', 38, 0, 46, '[]', '【插畫名人堂】耍花招美女人妻滿滿的肖肖正能量', '', 0, '<p>&nbsp;<img style="max-width: 100%;" src="image_0.jpg" alt="" width="621" height="100%" img_index="0"></p><p>一、基本資料</p><p>名稱：耍花招</p><p>國籍／居住地／原籍：台灣</p><p>Facebook年資： 2014年10月15日 – 至今</p><p>粉絲人數：153,347人 (截至151008)</p><p>&nbsp;</p><p>Facebook 帳號： <a href="https://www.facebook.com/littleflower4710">littleflower4710</a></p><p>Instagram帳號： <a href="https://instagram.com/littleflower4710/">littleflower4710</a></p><p>&nbsp;</p><p>二、簡介</p><p>&nbsp;<img style="max-width: 100%;" src="image_1.jpg" alt="" width="620" height="100%" img_index="1"></p><p>　<span style="color: #339966;"><strong>耍花招</strong></span>是位讓人溫暖的<span style="color: #ff0000;">熱門臉書插畫家</span>，透過<span style="color: #3366ff;">將一朵俏皮的花花擬人化，化身成耍花招自己本身</span>，更是個充滿正能量的可愛超正幸福人妻，抱持著人生就是要開心的宗旨，也帶給身邊的人更多的溫暖與開心力量。</p><p><img style="max-width: 100%;" src="image_2.jpg" alt="" width="620" height="100%" img_index="2"></p><p><img style="max-width: 100%;" src="image_3.jpg" alt="" width="620" height="100%" img_index="3"></p><p>　<span style="color: #339966;"><strong>耍花招</strong></span>會因為各種不同的時事狀況改自己的大頭貼等，像是為了亞航、義大利渡輪事件將自己塗成黑黑灰灰，也有配合美國同性法規通過所以改成彩虹頭貼，都是能和時事接上軌。</p><p>&nbsp;</p><p>三、插畫風格</p><p>　<strong><span style="color: #339966;">耍花招</span></strong>的插畫題材很多元，不是僅止於要給粉絲們笑笑而已，<span style="color: #ff0000;">充滿了許多不同種類，像是生活中會發生的事情、人與人之間情感狀況和鼓勵別人激勵自己的一些小啟示。</span>可愛又溫柔的畫風讓人覺得很暖心，每天看都可以有被溫暖的感覺。</p><p><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p>&nbsp;　↑周年慶有各種不同類型的人。</p><p><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p><p>　↑好友就是有聊不完的話。</p><p><img style="max-width: 100%;" src="image_6.jpg" alt="" width="350" height="100%" img_index="6"></p><p>　↑走入婚姻後就多了兩個爸爸媽媽了。</p><p>　在生活中什麼都可以當作題材，可能是妳我日常都會遇到的狀況。</p><p>&nbsp;</p><p>&nbsp;<img style="max-width: 100%;" src="image_7.jpg" alt="" width="348" height="100%" img_index="7"></p><p>　↑適時地給個鼓勵就能夠給別人很多力量。</p><p><img style="max-width: 100%;" src="image_8.jpg" alt="" width="350" height="100%" img_index="8"></p><p>　↑就算什麼都不做，陪在朋友身邊就是最棒的了。</p><p><img style="max-width: 100%;" src="image_9.jpg" alt="" width="350" height="100%" img_index="9"></p><p>　↑人與人之間有爭吵是難免的，但怎麼解決是最重要的。</p><p>　沒有人是可以孤獨生活的個體，多多少少會與身邊的人互動，互動之間就會醞釀出各種狀況，無論是嬉鬧或是爭吵，情感的狀況是每個人最常會遇到的。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_10.jpg" alt="" width="400" height="100%" img_index="10"></p><p>　↑愛自己。</p><p>&nbsp;<img style="max-width: 100%;" src="image_11.jpg" alt="" width="350" height="100%" img_index="11"></p><p>　↑克服困難後就知道自己學會了勇敢。</p><p><img style="max-width: 100%;" src="image_12.jpg" alt="" width="350" height="100%" img_index="12"></p><p>　↑發自內心的快樂才是真正的快樂。</p><p>　<strong><span style="color: #339966;">耍花招</span></strong>最特別的莫過於她<span style="color: #ff0000;">豐富的正能量，會有各種鼓勵別人、看了也會激勵人心的插畫和溫暖的話</span>，可以讓粉絲們看完也都接收到滿滿的力量。</p><p>&nbsp;</p><p>四、熱門影音作品</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/littleflower4710/videos/vb.636742419776516/783395428444547/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/littleflower4710/videos/783395428444547/"><p>還要繼續打電動嗎？追蹤Instagram：littleflower4710合作頻道:台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/littleflower4710">耍花招</a> on Thursday, July 9, 2015</blockquote></div></div><p>&nbsp;</p><p>　大家常常因為玩手機、遊戲，就不小心忽略了身邊的人，耍花招就教大家如何讓對方停下來不要玩了，用可愛的方法讓身邊的人多陪陪自己，也是提醒自己要好好珍惜時間陪著身邊的人。</p><p>&nbsp;</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/littleflower4710/videos/vb.636742419776516/735424509908306/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/littleflower4710/videos/735424509908306/"><p>別忘了多寵寵自己的女友哦❤..歌詞曲：五月天 Mayday-寵上天..合作頻道:台灣達人秀.★歡迎追蹤耍花招IG帳號:littleflower4710https://instagram.com/littleflower4710</p>Posted by <a href="https://www.facebook.com/littleflower4710">耍花招</a> on Thursday, April 9, 2015</blockquote></div></div><p>&nbsp;</p><p>　男女朋友之間在一起久了，可能不小心忘了當初的甜蜜，耍花招就用詼諧的方式來提醒大家，別忘了多寵寵你的女朋友、妳的男朋友。</p><p>&nbsp;</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/littleflower4710/videos/vb.636742419776516/794323830685040/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/littleflower4710/videos/794323830685040/"><p>你曾這樣傷過人嗎？還是被傷呢？追蹤Instagram：littleflower4710合作頻道:台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/littleflower4710">耍花招</a> on Friday, July 31, 2015</blockquote></div></div><p>&nbsp;</p><p>　每個人都會有負面情緒的時候，但在不開心時卻可能不經意地傷害的關心自己的人，或是自己也曾經主動給予關心卻被傷害，耍花招用溫柔的花花講出大家的心聲「我也是會受傷的」，<span style="color: #ff0000;">最重要的是別讓不開心傷了彼此間的感情。</span></p><p>&nbsp;</p><p>五、外部連結</p><p>&nbsp;<img style="max-width: 100%;" src="image_13.jpg" alt="" img_index="13"></p><ol><li><a href="https://store.line.me/stickershop/product/1181549/zh-Hant">LINE原創貼圖</a></li></ol><p>　臉書人氣插畫家當然不只是臉書上面看得到，在LINE也可以買到耍花招的貼圖，這樣跟朋友聊天過程中也可以看到溫暖的花花了喔！</p><p>&nbsp;</p><ol start="2"><li>在誠品生活+「<a href="https://www.esliteliving.com/news/news_detail.aspx?a=TW&amp;l=b&amp;flag=NA&amp;class=&amp;no=201509240001">圖文作家看Shopping fever</a>」活動中，誠品生活結合了六位網路插畫家，其中就包括了正妹人妻耍花招，會畫出許多周年慶的現象，可以看到耍花招的作品。</li></ol><p>&nbsp;</p><p>&nbsp;</p><p>看更多耍花招的經典作品</p><p>&nbsp;</p><p>動畫合集(一)：</p><p>動畫合集(二)：</p><p>插畫合集(一)：</p>', '2015-10-13 10:10:36'),
(1833, 1610000227, 0, 0, 150, 'none', '{}', '{"0":"https://www.youtube.com/embed/zavBDiSNhZE"}', 'pagicon.png', 104, 0, 2, '["什麼男孩","what boys","翻唱","女孩你知道嗎","謝和弦"]', '女孩你知道嗎Covered by 政霖｜什麼男孩What boys【搞笑】 ', '', 0, '<p><div class="youtobe_video"><iframe style="max-width:100%;" width="830" height="467" src="https://www.youtube.com/embed/zavBDiSNhZE" frameborder="0" allowfullscreen=""></iframe></div></p><p>【本文由 什麼男孩What boys 合作授權，未經同意請勿任意轉載】</p>', '2015-08-04 15:05:29'),
(1910, 163, 0, 0, 171, '', '{"0":"20151023092548544900.jpg","1":"20151023092548547847.jpg","2":"20151023092548549238.jpg","3":"20151023092548550542.jpg","4":"20151023092548551763.jpg","5":"20151023092548553024.jpg","6":"20151023092548554192.jpg","7":"20151023092548555703.jpg","8":"20151023092548557181.jpg","9":"20151023092548558315.jpg","10":"20151023092548559419.jpg","11":"20151023092548560695.jpg"}', '{"0":"https://www.youtube.com/embed/cUs-YlHKvXM"}', 'pagicon.jpg', 68, 0, 46, '[]', '【插畫名人堂】當紅惡搞獵奇風格鹿人情侶檔', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" width="619" height="100%" img_index="0"></p><p>&nbsp;</p><p>一、基本資料</p><p>&nbsp;<img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1"></p><p><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p>名稱：鹿人</p><p>國籍／居住地／原籍：台灣</p><p>Facebook年資：2014年5月20日 – 至今</p><p>粉絲人數：183,474人 (截至151015)</p><p>&nbsp;</p><p>Facebook 帳號： <a href="https://www.facebook.com/twodeerman/">twodeerman</a></p><p>Instagram帳號： <a href="https://instagram.com/twodeerman">twodeerman</a></p><p>插畫專欄：<a href="http://goo.gl/4rQScC">DeerMan</a></p><p>&nbsp;</p><p>二、簡介</p><p><img style="max-width: 100%;" src="image_3.jpg" alt="" width="500" height="100%" img_index="3"></p><p>　鹿人不是只是一個人的臉書插畫家，而是一對奇怪但又可愛俏皮的情侶檔，兩位都還是學生，特別的是不是本科系出身的，但他們就是喜歡畫一些獵奇又好笑又有梗又特別又很多腹肌的人事物，男朋友是主要負責畫圖，女朋友就負責上色跟制止他畫一些太18禁的題材，以防粉絲專頁不小心被停權。</p><p>&nbsp;</p><p>三、插畫風格</p><p>&nbsp;<img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p>　↑被范瑋琪按讚的范范販尾鰭。</p><p><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p><p>　↑結果網友還說可以變成兩百五。</p><p><img style="max-width: 100%;" src="image_6.jpg" alt="" width="350" height="100%" img_index="6"></p><p>　↑馮迪索被騎。</p><p>　鹿人動物園之看了想打人系列，是用詼諧的諧音聯想到各種不同的梗，讓人看了不只是會心一笑，甚至會捧腹大笑，除了鹿人自己想梗以外，也會畫粉絲們投稿的梗，給大家看大量好笑又好玩的作品。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_7.jpg" alt="" width="350" height="100%" img_index="7"></p><p><img style="max-width: 100%;" src="image_8.jpg" alt="" width="350" height="100%" img_index="8"></p><p>　小小兵漫畫連載系列雖然只有出了兩話，不過也讓許多網友看了都可以大笑很長時間。小小兵變成小小乒，小小乒再變成小小丘，所以小小丘會變成什麼呢？</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_9.jpg" alt="" width="350" height="100%" img_index="9"></p><p><img style="max-width: 100%;" src="image_10.jpg" alt="" width="350" height="100%" img_index="10"></p><p><img style="max-width: 100%;" src="image_11.jpg" alt="" width="350" height="100%" img_index="11"></p><p>　還有一些是成語系列，從中國文學經典中的經典許多成語當成主題題材，讓成語不再只是硬梆梆的文言文，更是讓大家會想看了再看，笑了又笑的圖。</p><p>&nbsp;</p><p>四、熱門影音作品</p><div class="fb-video" data-allowfullscreen="1" data-href="/twodeerman/videos/vb.664829723590814/902358913171226/?type=3">&nbsp;</div><p>　許多人童年看卡通的恐怖回憶(?)，結合了超洗腦的「天‧線‧寶‧寶‧說‧你‧好」，有50多萬的觀看次數，還有不少網友說小時候的記憶的被翻開了。</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/twodeerman/videos/vb.664829723590814/899170480156736/?type=3">&nbsp;</div><p>　原來吃冰加辣可以連結到韓國天團BIGBANG的熱門歌曲，讓想學韓文的還可以跟著唱，就像是空耳歌詞，真是貼心的鹿人。</p><div class="fb-video" data-allowfullscreen="1" data-href="/twodeerman/videos/vb.664829723590814/944636668943450/?type=3">&nbsp;</div><p>　中秋節送上感人系列的影片，呼籲情侶間更需要同理心，好男人也要學會做家事，不愧是月圓人團圓的日子，真的太感人又好笑。</p><p>&nbsp;</p><p>五、外部連結</p><p>娛樂百分百 – 2015/10/12娛樂神爆掛</p><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/cUs-YlHKvXM" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>　鹿人的火紅程度，讓藝人蔡小潔在娛樂百分百推薦，大家在娛樂百分百也看到鹿人情侶檔，除了介紹了他們的作品外，也透過遊戲讓更多作品得到曝光的機會。</p><p>&nbsp;</p><p>&nbsp;</p><p>看更多鹿人的經典作品</p><p>動畫合集(一)：</p><p>動畫合集(二)：</p><p>插畫合集(一)：</p>', '2015-10-15 11:10:54'),
(2050, 161, 0, 0, 127, '', '{"0":"20151029112652279709.jpg","1":"20151029112652280956.jpg","2":"20151029112652281961.jpg","3":"20151029112652282961.png","4":"20151029112652284536.jpg","5":"20151029112652285763.jpg"}', '{}', 'pagicon.jpg', 22, 0, 4, '["插畫家","插畫精選","生活","搞笑","宋小明SUNG"]', '【宋小明】插畫精選(六)：好人做錯一件事情時', '', 0, '<p style="text-align: center;">1.好人做錯一件事情時</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.同樣都是狗</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.攻城戰</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.靜香選擇大雄的真相</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.png" alt="" width="401" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.獅子怎麼樣才會回頭?</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="399" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.從騎機車的方式看出感情狀態</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5"></p>', '2015-10-26 12:53:15'),
