(2022, 161, 0, 0, 64, '', '{"0":"20151029095045911124.jpg","1":"20151029095045913109.jpg","2":"20151029095045914138.jpg","3":"20151029095045915129.jpg","4":"20151029095045916541.jpg","5":"20151029095045917610.jpg"}', '{}', 'pagicon.jpg', 25, 0, 4, '["Master Fey 廢大獅","插畫精選","插畫家","友情","愛情"]', '【廢大獅】插畫精選(八)：無法抗拒特價的情侶', '', 0, '<p style="text-align: center;">&nbsp;1.無法抗拒特價的情侶</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="401" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.一些人的抱怨</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.好幾天沒有一起睡了</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.如何治好對蝦子過敏的男朋友?</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.如果身邊有想不開的朋友</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.只有我可以靠邀你，其他人休想</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="401" height="100%" img_index="5">&nbsp;</p>', '2015-10-23 13:36:26'),
(1146, 1610000107, 0, 0, 125, 'none', '{"0":"2015072218014910057.jpg","1":"2015072218014912290.jpg","2":"2015072218014913893.jpg","3":"2015072218014924206.jpg"}', '{}', 'pagicon.png', 6, 0, 6, '["寵物聯萌","網購","寵物"]', '主人網上買到不合衣服，竟被貓星人「穿上」了 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true"><p>相信很多人都有在網拍購物買到照片和實物不符的糟糕經驗，日前在亞馬遜購物平台上的這件女性上衣收到了大部分買家的低評價，而且都是宣稱它實在”太小件” 了，可偏偏它是件one size(均碼)的衣服。</p>\n<p>一名住在美國德州休士頓的家長本來是想買給16歲女兒穿的，不料實際收到的商品卻小的令他驚嘆，不同於其他人的留言評價，他決定附上一張照片證明他買到的這件衣服絕對是送錯了！</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.jpg" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false" style="text-align: center;">▲一開始商品頁面標示的單一尺碼的上衣</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.jpg" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false" style="text-align: center;">▲這件商品收到了不少一顆星的評價</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.jpg" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲被買家票選為最有幫助的內容是這篇附有照片的評論</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.jpg" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;"><span style="color: #333333; font-size: 13px; font-family: ''Helvetica Neue'', Helvetica, Arial, 微軟正黑體, sans-serif;">▲貓星人示範穿搭，看起來真的是寵物裝沒錯！</span></p>\n<p style="text-align: center;"><span style="color: #333333; font-size: 13px; font-family: ''Helvetica Neue'', Helvetica, Arial, 微軟正黑體, sans-serif;">不過看看貓咪不情願的樣子，這位買家說，就算是買給貓咪穿的也不建議</span></p>\n                            <p contenteditable="false">其實網路商店裡本來就充斥著許多圖文誇飾的訊息，消費者若不保持理智清醒很容易就會衝動購買，下次上網購物前還是三思比較保險。</p>\n                </div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 18:01:49'),
(1144, 163, 0, 0, 33, 'none', '{}', '{}', 'pagicon.png', 21, 0, 6, '["新聞","朋友"]', '想懶在家裡，朋友卻熱情邀約怎麼辦？', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true"><p>週末與朋友相約狂歡玩樂雖然是在所難免，可是整個禮拜熬夜、工作、加班下來，好不容易可以放鬆休假，拖著疲累的身心有時候只想懶懶地宅在家，但朋友邀約盛情難卻該如何是好?</p>\n<p>&nbsp;</p>\n<p>&nbsp;<img src="TTSHOW/Account/163/Original/20150630111033932180.jpg" alt="" width="600" height="330"></p>\n<p>▲大夥們相約一起晚上來場BBQ</p>\n<p></p>\n<p><img src="TTSHOW/Account/163/Original/20150630111033963375.jpg" alt="" width="600" height="332"></p>\n<p>▲此時你在腦中幻想的周末美好假期卻是…</p>\n<p></p>\n<p><img src="TTSHOW/Account/163/Original/20150630111033932179.jpg" alt="" width="600" height="328"></p>\n<p>▲一個人在家也能盡情享受美酒及浪漫氣氛</p>\n<p></p>\n<p><img src="TTSHOW/Account/163/Original/20150630111033854178.jpg" alt="" width="600" height="329"></p>\n<p>▲就算賴在床上一整天也是小確幸</p>\n<p></p>\n<p><iframe width="600" height="338" src="https://www.youtube-nocookie.com/embed/TaenYe6Te5E" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\n<p>&nbsp;</p>\n<p>是的，大方說出你已經有計畫了(即便計畫就是整天無所事事也不要緊)，不需要朋友的每攤聚會都報到，試著缺席一次讓自己放個假，來場身心靈都放鬆到軟趴趴的休息。別擔心，下週他們還是會記得你的。所以，盡情享受吧！一個人的週末。</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-06-30 11:18:03'),
(1145, 163, 0, 0, 33, 'none', '{}', '{}', 'pagicon.png', 11, 0, 6, '["侏儸紀"]', '侏儸紀主題曲 經典重現', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true"><p><img src="../../Ttshow/Account/163/Original/20150630112600488501.jpg" width="600" height="235"></p>\n<p>侏儸紀公園的角色們唱起自己的電影主題</p>\n<p></p>\n<p>全民瘋狂的電影侏儸紀世界乃源自1993年的侏儸紀公園之續集，侏儸紀公園自第一集後便陸續拍攝了侏儸紀公園二和三集，但遲至2015年才終於釋出各界引頸企盼的續集四，可以說是讓恐龍迷們等到花兒都謝了。</p>\n<p>&nbsp;</p>\n<p>Youtube上有網友為了紀念這偉大的一刻錄製了經典侏儸紀公園的主題曲A<em>cappella </em>人聲合唱版本，還特別邀請知名歌手Peter Hollens合作演唱。 影片前奏一下，整個一幕幕回憶湧上心頭，昔日的大草原與恐龍們都回來了，想到小時候看電影時還被嚇得半夜做惡夢，如今看來皆是經典回憶。(馬上衝去租DVD1、2、3集複習中)</p>\n<p></p>\n<p><img src="../../Ttshow/Account/163/Original/20150630112709129232.jpg" width="500" height="280"></p>\n<p>Peter Hollens 身穿經典侏儸紀公園角色服裝演唱</p>\n<p>&nbsp;</p>\n<p><iframe width="600" height="338" src="https://www.youtube-nocookie.com/embed/1H1MhLVsvmc" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-06 11:20:17'),
(1142, 163, 0, 0, 33, 'none', '{}', '{}', 'pagicon.png', 33, 0, 6, '["英國皇家憲兵隊","熱門影片"]', '英國皇家憲兵隊巡邏，阻擋的下場超慘', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true"><p>到英國旅遊幾乎被列為必看的行程就是那雄赳赳氣昂昂的皇室憲兵隊，經典的大黑帽配上紅色制服幾乎已經成為代表英國的標誌之一，每回憲兵巡邏時更是招攬大批民眾圍觀拍照。這位阿伯手拿大砲相機看起來超專業的，但是他忘了一點戰場上非常重要的注意事項，就是...千萬...不要...背對著你的敵人。</p>\n<p><img src="../../TTSHOW/Account/163/Original/20150629153426326875.jpg" alt="" width="500" height="282" style="display: block; margin-left: auto; margin-right: auto;"></p>\n<p>&nbsp;</p>\n<p>現場民眾圍繞著路旁皆引頸企盼等著</p>\n<p><img src="../../TTSHOW/Account/163/Original/20150629153427886896.jpg" alt="" width="500" height="281" style="display: block; margin-left: auto; margin-right: auto;"></p>\n<p></p>\n<p>終於，步伐整齊的憲兵隊登場，腳步聲應該是蠻大的，都這麼近了還沒查覺嗎?!這位阿伯的聽力可能不是很好，悠閒繼續聊天中</p>\n<p>下一秒竟直接和一名憲兵撞上，而隊伍完全沒有要停下來的意思(疑似有忍不住偷喵)，這就是軍紀如鐵的真諦嗎!</p>\n<p style="text-align: center;"><img src="../../TTSHOW/Account/163/Original/20150629153429322113.jpg" alt="" width="500" height="281"></p>\n<p></p>\n<p><iframe width="500" height="375" style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube-nocookie.com/embed/NTr50aHGDnI" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\n<p>就在一聲慘叫中這風雨無阻的隊伍走過，眾人驚嚇呆滯了片刻，走道一下子清空，這會兒大家都學乖了：永遠不要站在憲兵隊要經過的路線上，值勤時連個搔癢動作都不能有的憲兵，你以為他會為你改變行徑路線嗎? 那你就太天真了！</p>\n<p></p>\n<p>來源：<a href="來源：https:/www.youtube.com/watch?v=NTr50aHGDnI">https://www.youtube.com/watch?v=NTr50aHGDnI</a></p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-06-29 15:38:05'),
(1847, 1610000227, 0, 0, 136, 'none', '{}', '{"0":"https://www.youtube.com/embed/FVOris6NuvQ"}', 'pagicon.jpg', 260, 0, 2, '["小嵐","美甲DIY","會動的小小兵"]', '進化版小小兵DIY指甲彩繪！｜跟小嵐一起變漂亮【美甲】', '', 0, '<p><div class="youtobe_video"><iframe style="max-width:100%;" width="560" height="315" src="https://www.youtube.com/embed/FVOris6NuvQ" frameborder="0" allowfullscreen=""></iframe></div></p>', '2015-08-05 16:33:07'),
(1851, 163, 0, 0, 151, 'none', '{}', '{"0":"https://www.youtube.com/embed/TA8iaSLd4to"}', 'pagicon.png', 14618, 29, 2, '["翻譯","搞笑翻譯王","短片","爆笑","影片","vine"]', '爆笑短片大合集2 (中文字幕) | 搞笑翻譯王【影片】', '', 0, '<p><div class="youtobe_video"><iframe style="max-width:100%;" width="830" height="467" src="https://www.youtube.com/embed/TA8iaSLd4to" frameborder="0" allowfullscreen=""></iframe></div></p>', '2015-08-06 14:35:34'),
(1839, 1610000231, 0, 0, 149, 'none', '{}', '{"0":"https://www.youtube.com/embed/lBbbldza2Bk"}', 'pagicon.jpg', 48, 0, 2, '["我是安安","大學生","趣味影片"]', '30秒看完大學生活▕ 我是安安【趣味】', '', 0, '<p><span style="color: #0000ff;"><strong><span style="font-size: 36pt;">短短幾秒～快速看完大學生活！</span></strong></span></p><p><span style="font-size: 24pt;">(純屬娛樂~別太認真囉!!)</span></p><p><div class="youtobe_video"><iframe style="max-width:100%;" width="830" height="467" src="https://www.youtube.com/embed/lBbbldza2Bk" frameborder="0" allowfullscreen=""></iframe></div></p>', '2015-08-05 12:34:34'),
(1840, 1610000240, 0, 0, 147, 'none', '{"0":"20150804182518384647.jpg","1":"20150804182520419256.png"}', '{}', 'pagicon.png', 674, 117, 43, '["崩井","文字","人生","自己"]', '崩井：別為了那些不屬於你的觀眾，演繹不擅長的人生。', '', 0, '<p>崩井：別為了那些不屬於你的觀眾，演繹不擅長的人生。</p><p><br>網絡上有一句熱話：「別為了那些不屬於你的觀眾，演繹不擅長的人生。」<br><br></p><p>我曾經不太認同這樣的想法。那時我認為，只要取得掌聲，只要有人欣賞，只要有人看見自己，那就是成功。所以在行事為人上，即或在寫作上，我都嘗試迎合世道。但最近整理稿件，看回那段時期的文章，總覺自己寫得特別虛浮膚淺，讀起來只感厭惡。<br><br></p><p><img style="max-width: 100%;" src="image_0.jpg" alt="" width="598" height="409" img_index="0"></p><p>其實，我們追逐著別人的掌聲，只因為我們自卑。我們不相信自己本身的價值，因而在舞台上演得浮誇，渴望得到別人的關注，得到別人的認可，漸而活在別人的需求之中，而殺死了那個可愛的自己。一位新知－－插畫家&nbsp;<a href="https://www.facebook.com/DawnKwok.Page" data-hovercard="/ajax/hovercard/page.php?id=134831936658867">Dawn Kwok 郭當</a>&nbsp;最近跟我說：「不要迎合市場呀，那樣會迷失。茫茫大海，寧可一等，也要找到正確的方向。」的確，惘然出航，隨時駛向一片無邊的苦海。<br><br></p><p>原來，無論我們當下取得的掌聲多大，那也是片刻的，甚至是附和的，還有一些人，只會拿我們當取樂的小丑看。不屬於我們的觀眾，始終不是我們的。散場後，滿場空凳，我們的生命，只會剩下無窮的落寞，和一副自己看著也覺厭膩的面具。<br><br></p><p>人生，就得這麼一回。成也好，敗也好，最少要活得無悔。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_1.png" alt="" width="603" height="450" img_index="1"></p><p>.<br>-------------------------------------<br>░▐ 崩井傾情之作｜香港現已有售▐░<br>.<br>一）《我們總是無法好好說再見》<br>訂購／詳情：https://goo.gl/D8RQM3<br>.<br>二）《從此，我們不再是我們》<br>訂購／詳情：https://goo.gl/fisWqS<br>.<br>----------------------------------------<br>作者：崩井（https://www.facebook.com/soulswell）<br>Instagram：soulswell<br>授權圖片：Alexas_Fotos</p>', '2015-08-04 18:25:20'),
(1064, 161, 0, 0, 34, '', '{}', '{}', 'pagicon.jpg', 20, 0, 2, '["這群人","Nono辜莞允","純屬娛樂","KUSO","搞笑"]', '【這群人 x Nono辜莞允演出】百萬經典：不掏錢回不了家旅行團', '', 0, '<div class="lyrow ui-draggable" style="display: block;"><span class="configuration"><button class="btn btn-default btn-xs btn-xs" data-toggle="modal" data-target="#myModalbackground">Background</button></span><div class="preview"><input class="form-control" type="text" value="12"></div><div class="view"><div class="row-fluid clearfix"><div class="col-md-12 column ui-sortable"><div class="box box-element ui-draggable" style="display: block;"><span class="configuration"> <!--button type="button" class="btn btn-default btn-xs" data-target="#editorModal" role="button" data-toggle="modal">Edit</button--> <button class="btn btn-default btn-xs" type="button" data-toggle="modal" data-target="#myModalforiframe"> URL </button> </span><div class=" preview drag"><strong>YouTube</strong></div><div class="view"><div class="youtobe_video"><div class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none;"><!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe--> <iframe src="//www.youtube.com/embed/kcEU_OcHXbk" width="300" height="150"></iframe></div></div></div></div></div></div></div></div>', '2015-06-12 16:45:01'),
(1071, 163, 0, 0, 33, 'none', '{"0":"20150625154928145399.png","1":"20150625154928182992.png","2":"20150625154928186351.jpg"}', '{"0":"//www.youtube.com/embed/R0-5HORRXU0"}', 'pagicon.png', 78, 0, 6, '["父親節","爸爸"]', '當這些男人聽到自己即將為爸爸的瞬間 超溫馨', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true"><p>已為人父母的都知道，養小孩是辛苦的…多開銷的奶粉尿布錢先不說，日後年年繳不完的學費…簡直就要被吃垮了，各位辛苦賺錢養家的爸爸們無不聞風色變，但在聽到老婆大人宣布懷孕消息時該做出什麼反應? 這幾位準爸爸們的表情保證經典。</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.png" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>「蝦毀!!! 大丈夫男子漢，我是不會哭的!!」</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>這位Daddy下巴差點沒掉下來…</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.jpg" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>男兒有淚不輕彈…我…我是在擦汗拉~！</p>\n                                        <div style="" class="youtobe_video">\n                                            <div name="u2_player" class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/R0-5HORRXU0"></iframe>\n                                            </div>\n                                        </div>\n                                <p>看完影片結尾有沒有給他揪感心，爸爸們是如此開心地迎接新生命的到來。</p>\n<p>影片目的不是要來糗各位爸爸的，原來是因為美國6月的第三個星期天是父親節，沐浴乳公司製作這個特別的企劃邀請大家一起來分享並且替初為人父的爸爸們加油打氣，祝爸爸們父親節快樂！</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-06-25 15:49:28'),
