(1140, 1610000107, 0, 0, 116, 'none', '{}', '{"0":"//www.youtube.com/embed/9DNb5fjH3o8"}', 'pagicon.jpg', 16, 0, 2, '["微辣創作 Manner Production","微電影"]', '【微辣】微電影 - 《態度》', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                                        <div class="youtobe_video" style="">\n                                            <div style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none" class="col-md-12 col-xs-12 col-lg-12 col-md-12" name="u2_player">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe src="//www.youtube.com/embed/9DNb5fjH3o8" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe>\n                                            </div>\n                                        </div>\n                                </div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-06-26 12:23:34'),
(1141, 163, 0, 0, 33, 'none', '{}', '{}', 'pagicon.png', 17, 1, 6, '["禮服","新娘","二手"]', '二手禮服夾藏字條，揭發一段背後不為人知的祕密', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true"><p>日前，英國一間專為癌症安寧病房募款的二手商店(St. Gemma’s Hospice Charity Shop)收到一件匿名捐贈的二手骨董新娘禮服，這件象牙白的禮服不但做工精緻且綴滿了精巧美麗的蕾絲，令人眼睛為之一亮。</p>\n<p>仔細檢查禮服的車工及製作手法看得出當時製作是特別為某位新娘子專屬打造的完美禮服，商店一在網路上貼出二手禮服信息時就立刻引起廣大迴響，網友們紛紛好奇地想知道這位幸運的新娘到底是誰，而又是誰將禮服捐了出來。</p>\n<p>但這件二手禮服除了以它的美麗外表備受注目外，捐出時隨附在禮服上的一張手寫字條更是讓這件禮服一夕間在網上爆紅。</p>\n<p>&nbsp;<img src="../../TTSHOW/Account/163/Original/20150629152242416168.jpg" width="500" height="400" style="display: block; margin-left: auto; margin-right: auto;"></p>\n<p>&nbsp;</p>\n<p>雖然是件骨董禮服，但它被保存得十分完好，穿上它就美得如同天使一般</p>\n<p>真正引爆話題禮服話題的是隨附的一張手寫字條</p>\n<p><img src="../../TTSHOW/Account/163/Original/20150629152312602464.jpg" width="500" height="389" style="display: block; margin-left: auto; margin-right: auto;"></p>\n<p>&nbsp;</p>\n<p>紙條內容大意是：希望下個穿著它與心愛的人牽手步入禮堂的女士能夠幸福快樂，就像56年前的我一樣。我是如此的幸運能娶到像我妻子那樣的女人。</p>\n<p>有個如此深愛著自己的老公，那位女士肯定也覺得自己是世界上最幸運的女人</p>\n<p><img src="../../TTSHOW/Account/163/Original/20150629152314958086.jpg" width="500" height="401" style="display: block; margin-left: auto; margin-right: auto;"></p>\n<p></p>\n<p>由於這件禮服這件背後的故事實在太夯，二收商店決定把它放到ebay上競標，截至6月18日，這件二手禮服的競標價格已經飆到2910歐元，相當於台幣10萬元左右</p>\n<p><img src="../../TTSHOW/Account/163/Original/2015062915231732916.jpg" width="500" height="407" style="display: block; margin-left: auto; margin-right: auto;"></p>\n<p></p>\n<p>透過網友的力量，二手商店後來找到了這位匿名捐贈過世妻子禮服和寫下動人字條地的先生，並且告知他這個好消息。他是位高齡85歲的老先生，他對於二手禮服引起如此廣大的回響感到相到驚訝，且非常高興「這件二手禮服能帶著他與妻子的美好回憶繼續延續下去。」</p>\n<p><img src="../../TTSHOW/Account/163/Original/20150629152318780130.jpg" width="500" height="279" style="display: block; margin-left: auto; margin-right: auto;"></p>\n<p>&nbsp;</p>\n<p>資料來源：http://www.buzzfeed.com/rachelzarrell/i-was-a-lucky-man?b=1#.lqRomoyLn</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-06-29 15:26:56'),
