(2070, 161, 0, 0, 175, '', '{}', '{}', 'pagicon.jpg', 17, 0, 4, '["插畫家","插畫精選","友情","啾啾妹","愛情"]', '【啾啾妹】插畫精選(六)：沒有網路的地方', '', 0, '<p style="text-align: center;"><span style="font-size: 14pt;">1.沒有網路的地方</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026173944585718.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">2.每到夏天我要吃~</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026173944713272.jpg" alt="" width="401" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">3.圖文不符的人</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026173944546559.jpg" alt="" width="401" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">4.另一半的前任的臉書</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026173944516883.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">5.死了..</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026173944522183.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">6.你要吃嗎?</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026173944484317.jpg" alt="" width="400" height="100%" data-pos="page"></p>', '2015-10-26 16:43:34'),
(2071, 161, 0, 0, 175, '', '{}', '{}', 'pagicon.jpg', 27, 0, 4, '["插畫家","插畫精選","友情","啾啾妹","愛情"]', '【啾啾妹】插畫精選(七)：我男友說..', '', 0, '<p style="text-align: center;"><span style="font-size: 14pt;">1.我男友說...</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026174513588450.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">2.睡前的爭執</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026174513439950.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">3.我不在意別人的眼光</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026174513413105.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">4.我餓的可以吃下一頭牛了!</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026174513352354.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">5.你會愛多久?</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026174513137714.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">6.飯與粥</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026174512391087.jpg" alt="" width="399" height="100%" data-pos="page"></p>', '2015-10-26 16:47:49'),
(2028, 161, 0, 0, 173, '', '{"0":"20151029103859669493.jpg","1":"20151029103859671411.jpg","2":"20151029103859672410.jpg","3":"20151029103859673401.jpg","4":"20151029103859674390.jpg","5":"20151029103859675309.jpg"}', '{}', 'pagicon.jpg', 18, 0, 4, '["人類超有病","插畫家","插畫精選","大學生活","家庭"]', '【人類超有病】插畫精選(四)：當家母發現作者的0分考卷', '', 0, '<p style="text-align: center;">&nbsp;1.家母發現作者的0分考卷</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.最偉大的發明</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.金木君問道...</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.當你在唱國歌時</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">5.好有禮貌的小孩!</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.看到同學倒大楣時...</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5"></p>', '2015-10-23 15:08:27'),
(2039, 161, 0, 0, 148, '', '{"0":"20151029110230215269.jpg","1":"20151029110230217785.jpg","2":"20151029110230219239.jpg","3":"20151029110230220833.jpg","4":"20151029110230223142.jpg","5":"20151029110230225258.jpg"}', '{}', 'pagicon.jpg', 17, 0, 4, '["小嘴愛畫畫","插畫家","愛情","插畫精選","兩性關係"]', '【小嘴愛畫畫】插畫精選(五)：最能解渴的水', '', 0, '<p style="text-align: center;">&nbsp;1.最能解渴的水</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.只喜歡優點，不是真愛</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.懶人的腳</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="399" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.前男友</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.颱風天要幹嘛?</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.軟軟的東西</p><p style="text-align: center;">&nbsp;<img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5"></p>', '2015-10-26 09:31:51'),
(1920, 161, 0, 0, 173, '', '{"0":"20151029103743747109.jpg","1":"20151029103743749300.jpg","2":"20151029103743750286.jpg","3":"20151029103743751342.jpg","4":"20151029103743752438.jpg","5":"20151029103743753346.jpg"}', '{}', 'pagicon.jpg', 35, 0, 4, '["人類超有病","插畫家","插畫精選","大學生活","友情"]', '【人類超有病】插畫精選(三)：當遭遇到免洗筷的攻擊時', '', 0, '<p style="text-align: center;">&nbsp;1.怎麼樣都拔不出來。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="351" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.班上永遠都會有一位小王存在</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="448" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.千萬不要與女性友人逛街啊</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.你是哪一種閃躲型？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">5.蠶寶寶生…？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.關於兒時的某卡通節目</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="351" height="100%" img_index="5"></p>', '2015-10-15 14:56:27'),
(1919, 161, 0, 0, 173, '', '{"0":"20151029103653855056.jpg","1":"20151029103653857836.jpg","2":"20151029103653858946.jpg","3":"20151029103653859983.jpg","4":"20151029103653860986.jpg","5":"20151029103653861980.jpg"}', '{}', 'pagicon.jpg', 36, 0, 4, '["人類超有病","插畫家","插畫精選","家庭","搞笑"]', '【人類超有病】插畫精選(二)：所有玩家都想要的"好媽媽"！', '', 0, '<p style="text-align: center;">&nbsp;1.都不用打LOL的嗎？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.寫作業還要經過老媽允許才可以進行的行程</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.還不准你偷偷來。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.真的只是去打網咖…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="349" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.結果自己老媽…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.然後作業寫太多的下場就是如此。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 14:39:17'),
(1918, 161, 0, 0, 173, '', '{"0":"20151029103615279116.jpg","1":"20151029103615281229.jpg","2":"20151029103615282349.jpg","3":"20151029103615283475.jpg","4":"20151029103615285997.jpg","5":"20151029103615287049.jpg"}', '{}', 'pagicon.jpg', 35, 0, 4, '["人類超有病","插畫家","插畫精選","大學生活","搞笑"]', '【人類超有病】插畫精選(一)：決定開學一定要力爭上游！不過…', '', 0, '<p style="text-align: center;">1.要游到學期末，不容易啊！</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.談錢果然傷感情</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.行書到草書的演化，沒有老師存在是無法促成的！！</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.不要問還沒事，一問就覺得好有病</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.認真掃的話會氣死自己吧？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.如果遇到了不愛排隊的人…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="351" height="100%" img_index="5"></p>', '2015-10-15 14:16:57'),
(1917, 161, 0, 0, 51, '', '{}', '{}', 'pagicon.jpg', 26, 0, 4, '["耍花招","插畫精選","插畫家","人生觀","愛情"]', '【耍花招】插畫精選(三)：面對人生種種困境時', '', 0, '<p style="text-align: center;">1.當你遇上了挫折</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015144747652880.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.當有人在你背後批評你的不是</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015144747512735.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.人總是會犯錯</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015144747536257.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.做自己的正能量</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015144747665373.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.愛是平等的</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015144747683688.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.服務業與客人之間，也需要互相尊重</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015144747850783.jpg" alt="" width="350" height="100%" data-pos="page"></p>', '2015-10-15 13:53:03'),
(1916, 161, 0, 0, 51, '', '{}', '{}', 'pagicon.jpg', 25, 0, 4, '["耍花招","插畫家","插畫精選","愛情","人生觀"]', '【耍花招】插畫精選(二)：校園生活之如果看到朋友在睡覺...', '', 0, '<p style="text-align: center;">1.當你看到朋友在睡覺時…</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015143002517390.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.成績不能代表一切</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015143002511999.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.小時候對於冰箱的研究</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015143002489025.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.討厭上學的真正原因</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015143002557119.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.好朋友之間，還是需要尊重</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015143002553569.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.和朋友一起過夜，你是屬於哪種人呢？</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015143002637928.jpg" alt="" width="350" height="100%" data-pos="page"></p>', '2015-10-15 13:36:47'),
(1915, 161, 0, 0, 51, '', '{}', '{}', 'pagicon.jpg', 43, 0, 4, '["耍花招","插畫家","插畫精選","勵志","愛情"]', '【耍花招】插畫精選(一)：人與人之間', '', 0, '<p style="text-align: center;">1.有時候分組時</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015141802213879.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.看到朋友的打卡…</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015141801334311.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.朋友歡笑過後</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015141801578738.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.關於珍惜你身邊的人</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015141802209915.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.怎麼樣讓生氣的另一半回你信息？</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015141802174811.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.多想是好事，但別想太多！</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015141757831791.jpg" alt="" width="350" height="100%" data-pos="page"></p>', '2015-10-15 13:27:41'),
(1914, 161, 0, 0, 94, '', '{"0":"20151029085621537552.jpg","1":"20151029085621538883.jpg","2":"20151029085621540009.jpg","3":"20151029085621540925.jpg","4":"20151029085621542157.jpg","5":"20151029085621543366.jpg"}', '{}', 'pagicon.jpg', 36, 0, 4, '["阿寶","插畫家","插畫精選","愛情","友情"]', '【阿寶】插畫精選(三)：交往前後大反差', '', 0, '<p style="text-align: center;">1.關於親嘴</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.愛的訊息往返</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">3.女友"那個來"的時候</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.熱戀時的華麗約會</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.還是不要知道比較好…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.原來吸血鬼也會挑對象？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 13:02:45'),
(1913, 161, 0, 0, 94, '', '{"0":"20151029085521507588.jpg","1":"20151029085521509638.jpg","2":"20151029085521511143.jpg","3":"20151029085521512183.jpg","4":"20151029085521513155.jpg","5":"20151029085521514342.jpg"}', '{}', 'pagicon.jpg', 42, 0, 4, '["阿寶","插畫家","插畫精選","愛情","搞笑"]', '【阿寶】插畫精選(二)：當與自己父親介紹另外一半時…？', '', 0, '<p style="text-align: center;">&nbsp;1.岳父那關好像不好過…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.千萬不要跟女友比。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.岳父、公公，兩樣情。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.要胖就要一起胖。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.不要輕易說出『分手』兩個字</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.五月天的演唱會…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 12:52:22'),
(2030, 161, 0, 0, 173, '', '{"0":"20151029103526790702.jpg","1":"20151029103526793144.jpg","2":"20151029103526795063.jpg","3":"20151029103526796280.jpg","4":"20151029103526797636.jpg","5":"20151029103526799271.jpg"}', '{}', 'pagicon.jpg', 20, 0, 4, '["人類超有病","插畫家","插畫精選","生活","搞笑"]', '【人類超有病】插畫精選(六)：我要跟小美說!!!', '', 0, '<p style="text-align: center;">&nbsp;1.我要跟小美說</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.只要會飛的，通通都很可怕</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="400" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.機長的聲明</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.不能指月亮啊</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">5.花的時間比別人多</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.你想的跟我想的一樣嗎?</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5"></p>', '2015-10-23 15:26:22'),
(1912, 161, 0, 0, 94, '', '{"0":"20151029085544658931.jpg","1":"20151029085544661227.jpg","2":"20151029085544663050.jpg","3":"20151029085544664156.jpg","4":"20151029085544665322.jpg","5":"20151029085544666331.jpg"}', '{}', 'pagicon.jpg', 48, 0, 4, '["阿寶","插畫家","插畫精選","生活","搞笑"]', '【阿寶】插畫精選(一)：你掉的女友是哪一位？', '', 0, '<p style="text-align: center;">&nbsp;1.你掉的是這位女友嗎?</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.絕對不要鼓吹女友減肥！</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.關於瑞拉小姐的彩妝技巧</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.看來是找錯對象了....</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.無論怎麼樣都要掩蓋這個事實…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.瑞拉的壁咚初體驗</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 12:36:13'),
(2029, 161, 0, 0, 173, '', '{"0":"20151029103454451566.jpg","1":"20151029103454453140.jpg","2":"20151029103454454328.jpg","3":"20151029103454456049.jpg","4":"20151029103454457865.jpg","5":"20151029103454459691.jpg"}', '{}', 'pagicon.jpg', 21, 0, 4, '["人類超有病","插畫家","插畫精選","生活","搞笑"]', '【人類超有病】插畫精選(五)：剛玩IG五天就遇到這樣的現象', '', 0, '<p style="text-align: center;">&nbsp;1.剛玩IG五天就遇到這樣的現象</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.狂讚士</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="401" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.神奇海螺萬萬歲</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.鬼月不能做的五件事</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">5.服務業的辛苦，你懂不懂?</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.人間胸器，沒事不要外露</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5"></p>', '2015-10-23 15:17:03'),
(1911, 161, 0, 0, 174, '', '{}', '{}', 'pagicon.jpg', 33, 0, 4, '["鹿人","插畫家","插畫精選","搞笑","諧音梗"]', '【鹿人】插畫精選(三)：有時候真的就是會秒忘…', '', 0, '<p style="text-align: center;">1.有時候真的就是會秒忘</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015120507603114.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.針葉林與...</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015120507543855.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.吳鳳接__</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015120507540525.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">4.小孩子看到會嚇哭的吧</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015120507533087.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.原來那濃濃的香是來自於你啊～</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015120507514515.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.還是要好好遵守交通規則哦～</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015120507577182.jpg" alt="" width="350" height="100%" data-pos="page"></p>', '2015-10-15 11:16:56'),
(1691, 163, 0, 0, 125, 'none', '{"0":"20150728163300566918.png","1":"20150728163300572834.png","2":"20150728163300576347.png","3":"20150728163300576898.png","4":"20150728163300580174.png"}', '{"0":"//www.youtube.com/embed/U33ji6TV6XI"}', 'pagicon.png', 0, 0, 7, '["寵物聯萌","瑪爾濟斯","流浪動物","幼犬"]', '流浪狗爸爸不畏艱困環境　獨自撫養3子 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                    <p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%; display: block; margin-left: auto; margin-right: auto;" src="image_0.png" img_index="0"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲狗爸爸艱困環境下獨自撫養3幼犬。被帶回救援組織安置時幼犬們處處黏著狗爸爸，互動相當親密。</p><p>動物救援團體Hope for Paws(希望爪子)在加州康普頓的鋼鐵廠裡救援了4隻混種瑪爾濟斯，包括三隻幼犬及一隻成犬，竟人吃驚的是，執行救援任務的成員們一直到真正抱起成犬時，才發現原來而照顧著3隻幼犬的不是狗媽媽而是隻狗爸爸。</p>\n<p>通常流浪動物裡負責撫養小孩的總是母犬，而公犬就是把人家肚子搞大後就一走了之，但這隻瑪爾爸爸不但選擇留在幼犬身邊，還必須在艱困環境下冒著危險穿梭馬路間尋找食物來撫養幼犬，見狀的人都說他實在非常偉大。</p><p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_2.png" width="600" img_index="2"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p><p>▲他們原先生活在環境險惡的鋼鐵廠內</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.png" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲因為還不是很信任人類，狗狗本能地將自己塞進一堆搖搖欲墜的木材中，救援隊必須要很小心地把他拉出來</p><p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img mmid="1" key="img" style="max-width: 100%;" src="image_4.png" width="600" img_index="4"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p><p contenteditable="false">▲被帶回救援組織內裡完澡治療後的小狗們看起來活蹦亂跳繞著爸爸玩耍</p><p contenteditable="false">巧合的是，4隻瑪爾濟斯被找到時正值6月美國父親節，救援組織將故事及救援過程影片放到網路上，希望大家能幫忙分享這個家庭的故事，並且找到適合一次收養4隻狗狗的民眾，不要讓這個家庭被拆散了。</p>\n                                        <div style="" class="youtobe_video">\n                                            <div name="u2_player" class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/U33ji6TV6XI"></iframe>\n                                            </div>\n                                        </div>\n                                </div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-28 16:33:00'),
(2072, 161, 0, 0, 175, '', '{}', '{}', 'pagicon.jpg', 22, 0, 4, '["插畫家","插畫精選","友情","啾啾妹","愛情"]', '【啾啾妹】插畫精選(八)：今天上班快遲到...', '', 0, '<p style="text-align: center;"><span style="font-size: 14pt;">1.今天上班快遲到</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026175817942627.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">2.閉著眼都能玩</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026175817921560.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">3.洗頭髮最怕遇到的事情</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026175817349522.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">4.晚餐吃什麼?</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026175817952757.jpg" alt="" width="400" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">5.嗯?好像胖了!</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026175817997962.jpg" alt="" width="401" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size: 14pt;">6.在路上遇到流浪狗的話</span></p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151026175818121029.jpg" alt="" width="400" height="100%" data-pos="page"></p>', '2015-10-26 17:01:18'),
(1690, 1610000107, 0, 0, 125, 'none', '{"0":"2015072217543724489.png","1":"2015072217543728056.png","2":"2015072217543731718.png","3":"2015072217543733454.png"}', '{"0":"//www.youtube.com/embed/J_8mdH20qTQ"}', 'pagicon.png', 0, 0, 7, '["滑翔機","貓咪","影片","寵物聯萌","自拍"]', '滑翔機起飛離地時，這隻貓咪才明白自己犯下一個大錯 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                    <p>貓咪貪玩躲機上，糊里糊塗跟著飛上天：網路上出現這段自拍滑翔機飛行的影片，片中兩人乘坐滑翔機飛上天空時，突然從機翼上爬出一隻小貓，駕駛員發現後嚇了一大跳，完全摸不著頭緒這位乘客打哪來的。</p>\n<p>礙於高空中不便行動，駕駛員只得繼續行駛，雖然上空風超大，吹得這隻小貓的毛不斷亂飛，不過牠緊緊抱著機翼桿子似乎挺享受翱翔天際的快感?!</p>\n<p>隨後駕駛員趕緊於跑道上降落滑翔機，但當他伸手想要抱下這隻誤闖的貓咪時，她卻自顧自一溜煙地跳下機翼跑走了，不曉得是不是因為這已經不是牠第一次偷渡上滑翔機玩了…。</p>\n<p>這起飛天貓咪的事件發生在法國，影片由一位名叫Romain Jantot 的youtube用戶上傳，並且將影片名稱取為「起飛前請將貓咪移除」(暗示它為起飛前應做的一項例行檢查)。</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img src="image_0.png" class="" style="width: 100%; max-width: 100%;" key="img" mmid="1" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false">▲滑翔機已離開地面時，貓咪才從機翼後端爬出，抬頭一往下看，似乎發現他犯了一個很大的錯誤</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false">▲駕駛員發現她時瞪大眼睛嚇了一跳 (你必須承認這可與開車時發現引擎蓋上有隻貓的情形一點也不同，我們這會兒可是空中呀！)&nbsp;</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲強風一直不斷將貓咪的毛向後吹，風大到連眼睛都睜不開了，不過迎著風的她似乎有點”享受”這場與眾不同的「兜風」行程</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.png" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false">▲完全不用系安全帶，貓咪憑藉過人的平衡感，幸運地安全度過整趟飛行</p>\n                                        <div style="" class="youtobe_video">\n                                            <div name="u2_player" class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/J_8mdH20qTQ"></iframe>\n                                            </div>\n                                        </div>\n                                <p contenteditable="false">影片註：不知道貓咪是在起飛前的例行檢查後才偷溜上機翼的，還是檢查時沒被發現，但她現在很好，還成了我們的吉祥物。</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:54:37'),
(1692, 1610000107, 0, 0, 125, 'none', '{"0":"20150722175443626421.png","1":"20150722175443630279.png","2":"20150722175443632417.png","3":"20150722175443650362.png"}', '{}', 'pagicon.png', 0, 0, 7, '["寵物聯萌","傑克羅素梗","鬥牛梗","流浪動物","導盲犬"]', '這隻全盲的狗和他的導盲犬夥伴，超級感人的友情 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                     \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.png" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false" style="text-align: center;">▲全盲的Glenn（左）走到哪都要和他最要好的朋友Buzz一起</p><p>這對好兄弟傑克羅素梗Glenn和鬥牛梗Buzz 5月時在英國哈特爾普(Hartlepool) 一處海底隧道內被一起被救援出來。Glenn目前10歲而且雙眼已經全盲，而Buzz是9歲，他倆不論走到哪都在一起。他們現在被安置收容在達勒姆郡的「流浪動物救助中心」(Stray Aid rescue centre)內等待認養。</p>\n<p>救助中心的人員表示：Buzz就像是Glenn的雙眼一樣，他會協助Glenn找到他的床鋪和食物，如果Glenn吃錯碗了Buzz還會推推他引導他到正確的地方。</p>\n<p>他倆形影不離的程度，就算只是把他們分開個幾分鐘，彼此都會顯得非常焦慮沮喪，他們對彼此來說，就像是家人一樣的存在。</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲Glenn完全信任<span>Buzz</span>，把自己交付在他的「腳掌」上</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲Buzz就這樣心甘情願地當起<span>Glenn</span>的導盲犬，與他四處闖蕩</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.png" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲救助中心希望兩隻狗狗能一同被認養，才不會破壞了他們之間建立起來信任與友誼</p><p>資料來源：<a href="http://www.buzzfeed.com/richardhjames/this-blind-jack-russell-has-his-own-guide-dog-and-the-insepa#.mqXM2MxjL" target="_blank">buzzfeed.com</a></p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:54:43'),
(1693, 1610000107, 0, 0, 125, 'none', '{"0":"20150722175504506828.png","1":"20150722175504512223.png","2":"20150722175504517256.png","3":"20150722175504521437.png"}', '{"0":"//www.youtube.com/embed/SzqndXLTlFc"}', 'pagicon.png', 0, 0, 7, '["寵物聯萌","貓咪","撒嬌","影片","寵物"]', '就是不讓你玩！貓咪與平板爭寵，撒嬌模樣令人融化 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                    <p>這隻來自挪威5歲大的貓咪Nala，只要主人一拿起遊戲把手，下一秒就馬上跳進來搗亂。主人於是剪輯了每次玩遊戲時Nala亂入的影片上傳，有網友留言貓星人好有愛，只想主人放注意力在自己身上，但也有人揶揄說：唉呀~他應該只是想要主人給牠食物啦！這隻來自挪威<span>5</span>歲大的貓咪Nala，只要主人一拿起遊戲把手，下一秒就馬上跳進來搗亂。主人於是剪輯了每次玩遊戲時Nala亂入的影片上傳，有網友留言貓星人好有愛，只想主人放注意力在自己身上，但也有人揶揄說：唉呀<span>~</span>他應該只是想要主人給牠食物啦！</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.png" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲受不了啦<span>~</span>大屁屁完全擋住銀幕怎麼玩啊<span>!!(</span>主人崩潰<span>)</span></p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p contenteditable="false">▲瞧！就算是玩平板遊戲也逃不了Nala的法眼<span>(</span>主人硬要玩是怎樣<span>…)</span></p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲一定要主人放下手上遊戲把手摸摸牠才甘願</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.png" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲最後，Nala還愛用這招<span>”</span>泰山壓頂<span>”-</span>直接把你的手壓住，看你還怎麼玩！</p>\n                                        <div style="" class="youtobe_video">\n                                            <div name="u2_player" class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/SzqndXLTlFc"></iframe>\n                                            </div>\n                                        </div>\n                                <p>儘管主人再怎麼無奈還是無法對可愛的Nala生氣，除了錄製和他互動的其他影片外，甚至還幫他申請了專屬的Instagram(<span><a href="https://www.youtube.com/redirect?q=https%3A%2F%2Finstagram.com%2Fliving_with_nala%2F&amp;redir_token=uySd4n-ptdwq_pPGiRE7Qk5JsD98MTQzNTEyNDE0OEAxNDM1MDM3NzQ4">https://instagram.com/living_with_nala/</a></span>)和Twitter(<span><a href="https://www.youtube.com/redirect?q=https%3A%2F%2Ftwitter.com%2FLiving_w_Nala&amp;redir_token=uySd4n-ptdwq_pPGiRE7Qk5JsD98MTQzNTEyNDE0OEAxNDM1MDM3NzQ4">https://twitter.com/Living_w_Nala</a></span>)帳號，在線即時分享Nala的日常生活趣事給也同樣喜歡<span>Nala</span>的網友們。</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:55:04');
INSERT INTO `page` (`page_id`, `user_id`, `special_tag_id`, `checker_id`, `channel_id`, `display`, `photo_list`, `movie_list`, `article_icon`, `c_num_click`, `share_num`, `class`, `tag`, `title`, `describe`, `appraisal`, `html`, `date`) VALUES
(1694, 1610000107, 0, 0, 125, 'none', '{"0":"2015072217551312404.png","1":"2015072217551317563.png","2":"2015072217551331634.png"}', '{"0":"//www.youtube.com/embed/I_zW6APE1qQ"}', 'pagicon.png', 2, 0, 7, '["失寵","媽媽","影片","寵物聯萌"]', '聽到狗狗喊出「媽媽」 一旁的小孩反應超爆笑 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                    <p>還沒有小孩之前，家中的寵物就是每對夫妻心中的”寶貝”，而直到真正的寶寶加入家庭裡後，狗狗常常明顯失寵於主人，而美國猶他州的這隻小型澳洲牧羊犬Patches可不這麼認為，他極力為自己「發聲」與這個9個月大的寶寶爭取媽媽的關注和…食物?!</p>\n<p>影片中主人腳上放著一大盤的好吃的作獎勵，邊教小孩開口叫”媽媽”，小朋友牙牙學語間就是湊不出這”媽媽”這兩個字，反倒是在一旁的聽的狗狗Patches一看見食物眼睛為之一亮，一直”媽媽”、”媽媽”的叫，小孩聽到便是緊張，情急之下，他的反應出乎所有人的意料。</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.png" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲小孩和狗狗眼睛都盯著食物看，究竟鹿死誰手</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲聽見狗狗先叫出了媽媽，小孩嘟起嘴巴來，顯得不太開心</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲「唉呀<span>~</span>賣來亂！」小孩不甘心被進度超前，忍不住用手推了幾下這隻不斷「開口叫媽媽」的狗狗<span> (</span>嗶<span>~</span>犯規<span>)</span></p>\n                                        <div style="" class="youtobe_video">\n                                            <div name="u2_player" class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/I_zW6APE1qQ"></iframe>\n                                            </div>\n                                        </div>\n                                <p>其實這隻狗兒能比小孩更快學會<span>”</span>講話<span>”</span>是因為他已經有上過「先修班」了，主人在<span>Patches</span>兩歲<span>(</span>現已十歲<span>)</span>的時候就已經開始教他開口叫「媽媽」，所以食物當前，他便使出看家本領來，一下子就打敗一旁的小主人。</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:55:13'),
(1695, 1610000107, 0, 0, 125, 'none', '{"0":"20150722175524843441.png","1":"20150722175524847927.png","2":"20150722175524851330.png","3":"20150722175524854710.png","4":"20150722175524857601.png","5":"20150722175524862733.png"}', '{}', 'pagicon.png', 1, 0, 7, '["寵物聯萌","企鵝","飼養員"]', '傻眼！這應該是有史以來第一隻會怕水的企鵝 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                     \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.png" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲身為企鵝卻不會游泳，飼育員充當教練開起游泳課</p><p>野生的企鵝相當諳水性，因為他們的食物來源就是水裡的魚，自然要會游泳；但是來自英國格洛斯特郡<span>(Gloucestershire)</span>這隻人工飼養的企鵝夏綠蒂，自從孵化後便由園方<span>(Birdland Park &amp; Gardens)</span>人員餵食飼養，食物幾乎都是直接送到口，導致長大後的他竟然害怕起水來，而不敢下水游泳。</p>\n<p>一般來說，企鵝會藉由在一旁觀看父母親的動作來學習游泳，所以一手拉拔他長大的飼育員<span>Alistair Keen</span>耐心地穿戴起淺水用具，要親自示範教導夏綠蒂游泳的技巧。</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲一開始夏綠蒂還不想面對，試圖逃避</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲先乖乖待在岸上看飼育員的示範</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.png" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲Alistair稱職地當起爸爸的角色，帶領夏綠蒂進入水池內</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_4.png" img_index="4"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲夏綠蒂終於克服恐懼主動跳進水中</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_5.png" img_index="5"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p class="MsoNormal" style="text-align: center;"><span face="新細明體, serif" style="font-family: 新細明體, serif;">▲</span><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: 新細明體; mso-fareast-theme-font: minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;">不過看這雞飛狗跳的樣子，夏綠蒂還得持續學習一陣子了</span><span lang="EN-US">…<o:p></o:p></span></p><p class="MsoNormal"><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: 新細明體; mso-fareast-theme-font: minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;">來源：<a href="http://metro.co.uk/2015/07/12/life-is-tough-for-this-penguin-whos-scared-of-swimming-5292186/" target="_blank">metro.co.uk</a></span></p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:55:24'),
(1696, 1610000107, 0, 0, 125, 'none', '{"0":"20150722175535201861.png","1":"20150722175535207345.png","2":"20150722175535212281.png","3":"20150722175535216703.png","4":"20150722175535225067.png","5":"20150722175535229673.png"}', '{"0":"//www.youtube.com/embed/V6ukn8aoUBY"}', 'pagicon.png', 2, 0, 7, '["浣熊","寵物聯萌"]', '萌翻！浣熊媽媽教孩子如何爬樹 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                    <p>俗話說的好：萬事起頭難。這天浣熊媽媽帶著小浣熊來到大樹下想教他如何爬樹，不料小浣熊好像很不情願，不顧媽媽用嘴銜著他這裡推那裡送的，說什麼就是不願好好伸手攀著樹幹，無奈之下，浣熊媽媽決定親自示範，過程中還不忘頻頻回頭確認孩子有沒有在認真學習，模樣好似人類母親。</p>\n<p>最後在媽媽半推半就之下，小浣熊總算決定雙手使勁，勉強算是攀著大樹，任務達成！來看看浣熊媽媽的教子秘訣。</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.png" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p class="1"><span face="新細明體, serif" style="font-family: 新細明體, serif;">▲</span><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Arial; mso-fareast-font-family: 新細明體; mso-fareast-theme-font: minor-fareast; mso-hansi-font-family: Arial;">媽媽推著小浣熊的屁股要他往上攀爬，小浣熊卻因害怕而一直抵抗</span><span lang="EN-US"><o:p></o:p></span></p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲跳到屋簷上，從另一個角度再試試，媽媽仍不放棄</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲後來浣熊媽媽採用身教方式，親自上陣示範，還頻頻回頭認真指導</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.png" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲可惜小浣熊不領情媽媽的諄諄教誨，依舊抵死不從還想落跑</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_4.png" img_index="4"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲最後由媽媽親自在下面護送，小浣熊這才放心地一步步往上爬</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_5.png" img_index="5"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p>▲小浣熊：「可是，媽媽，我下不去了。」母：「<span>…</span>」<span>(</span>嘆<span>)</span></p>\n                                        <div style="" class="youtobe_video">\n                                            <div name="u2_player" class="col-md-12 col-xs-12 col-lg-12 col-md-12" style="text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none">\n                                                    <!--iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/oVduJ_y0IRM"></iframe-->\n                                                    <iframe style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;" mmid="1" key="video" mmtype="[''youtube'']" src="//www.youtube.com/embed/V6ukn8aoUBY"></iframe>\n                                            </div>\n                                        </div>\n                                <p>浣熊母子讓人回想起第一次學習騎腳踏車的時候，非要爸爸在後頭保證絕不放手才敢雙腳離地上車，往前騎了一段路後，一回頭，發現爸爸已在很遠的後方，原來心裡頭放心之餘，自己已經默默克服恐懼，學會騎腳踏車了。</p>\n<p>這時你才明白，說好的不放手，是每個父母心中對孩子永遠的承諾，陪伴我們踏出生命中每次的第一步！</p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 17:55:35'),
(1697, 1610000107, 0, 0, 125, 'none', '{"0":"20150722181348429243.png","1":"20150722181348432746.png","2":"20150722181348446200.png","3":"20150722181348461867.png","4":"20150722181348477924.png"}', '{}', 'pagicon.png', 0, 0, 7, '["3D列印","殘缺","寵物聯萌","狗"]', '多虧3D列印技術，這隻狗終於能站起來盡情奔跑 | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                     \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_0.png" img_index="0"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲Bubbles (泡泡)出生時就沒有前腳，</p>\n<p style="text-align: center;">主人Trevor Byers 和Elissa Smoak於是下定決心幫助他站起來</p><p>泡泡的媽媽是一隻流浪動物救援的狗，他出生時便有這個身體的缺陷，當Trevor Byers 和Elissa Smoak看見泡泡沒有前腳時，就決心要養他。當時市面上只有販售給狗狗支撐後腿用的輪車，所以他們想到了一個法子自己動手做，那就是用最新的3D列印技術。</p>\n<p>專屬泡泡的輔佐輪車的製作過程歷經許多的失敗和調整。一開始，他們做出來的輪車常會讓泡泡那瘦小的背部承受太大壓力，當然他們並不放棄繼續嘗試新的設計，直到有一次，當泡泡一裝備上輪車便開始狂奔了起來，他們才開心地知道他們總算成功了！</p>\n<p>Trevor Byers 和Elissa Smoak並不支持收容中心的狗狗們繁殖下一代，因為全世界的流浪度物救難和僻護所已經大爆滿，但他們卻覺得再僻護所出生的泡泡是一個「最棒的錯誤」。幫助泡泡成功站起來的經驗讓他們開始想做更多，於是他們開創了一個事業來幫助其他和泡泡有一樣情況的狗狗們。</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_1.png" img_index="1"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲雖然出生時就沒有前腳，但泡泡有一顆勇敢的心</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_2.png" img_index="2"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲他們結合金屬輪子的的高度調整性和3D列印的快速與輕便性質</p>\n<p style="text-align: center;">創造出專屬泡泡的輔助輪車</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_3.png" img_index="3"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲泡泡裝上輔佐輪車後能夠盡情四處奔跑探索</p> \n                                        <!--abin edit 2014/6/10  ++    -->\n                                        <!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div-->\n                                        <center> <img mmid="1" key="img" style="max-width: 100%;" class="" src="image_4.png" img_index="4"> </center>\n                                        <!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n                                        <!--20140609 HAO**-->\n                                        <!--abin edit 2014/6/10  --    -->\n                                <p style="text-align: center;">▲其它有一樣狀況的狗狗因為泡泡給主人帶來啟發的關係而有機會再次享受自由</p><p>泡泡給Trevor Byers 和Elissa Smoak帶來全新的視野去認識以及了解身障的狗兒們，這些本來都是他們一無所知的領域，然而感謝泡泡這個「美麗的錯誤」他們有機會學習並去幫助世界上更多的狗兒重獲自由與盡情奔跑。</p><p contenteditable="false">來源：<a href="http://www.buzzfeed.com/candacelowry/this-two-legged-dog-got-her-own-wheelchair-thanks-to-3d-prin#.hnyBOBqDp" target="_blank">buzzfeed.com</a></p></div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-22 18:13:48'),
(1698, 1610000191, 0, 0, 125, 'none', '{"0":"20150723110052473452.jpg","1":"20150723110052491685.jpg"}', '{}', 'pagicon.png', 3, 0, 7, '["寵物聯萌","警犬","排隊"]', '捕捉到這張網路爆紅的「警犬排隊等放飯」　網友直呼比人類還有秩序！ | 寵物聯萌 | 寵物', '', 0, '\n                                      <!--div class="container-fluid"></div-->\n                                      <div class="container-full">\n                                                <div class="row">\n                                                    <div class="col-md-12" hassortable="true">\n                    <p class="MsoNormal"><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;">你可能會覺得狗狗是沒耐心而且暴躁的，但是，有訓練過的就是不一樣喔</span><span lang="EN-US">!</span><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;">其實在這個世界上有許多勤奮工作的狗狗，他們會偵查有沒有炸彈、參與搜救部隊的工作，還有警犬和導盲犬等等，沒說的還有很多呢</span><span lang="EN-US">!<o:p></o:p></span></p>\n<p class="MsoNormal"><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;">會工作的狗狗非常的勤奮而且有耐心，日復一日，夜復一夜，所以看到這張照片也不用太驚奇，這就是排隊等吃飯的警犬，看看，是不是比你看過的任何可愛的狗狗還要討喜呢</span><span lang="EN-US">?</span><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;">而且說真的，這些狗狗也許比你我都還守規矩。</span></p><p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img img_index="0" mmid="1" key="img" style="max-width: 100%;" src="image_0.jpg" width="600"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p><p style="text-align: center;" contenteditable="false"><span style="font-family: ''新細明體'',serif; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;">▲這是一名攝影師在中國拍到的，不過這並不是第一次狗狗耐心等待食物而被鏡頭捕捉到喔</span><span style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal;" lang="EN-US">!</span></p><p></p>\n<!--abin edit 2014/6/10  ++    -->\n<p></p>\n<!--div id="image_localhost" mmid="1" mmtype="[''image'']" ></div--><center><img img_index="1" mmid="1" key="img" style="max-width: 100%;" src="image_1.jpg" width="600"></center><!--div id="image_localhost" mmtype="[''image'']" mmid="1" ></div-->\n<p></p>\n<!--20140609 HAO**-->\n<p></p>\n<!--abin edit 2014/6/10  --    -->\n<p></p><p style="text-align: center;" contenteditable="false">▲1940年在芬蘭捕捉的畫面，這些郵差犬乖乖地排隊即使他們十分的飢餓。</p>\n                            <p contenteditable="false"></p><p class="MsoNormal"><span style="font-family:&quot;新細明體&quot;,serif;mso-ascii-font-family:\nArial;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial">下次如果有人越界、插隊或是因為排隊而煩躁，請他們學習一顆狗狗乖乖排隊的心，像狗狗那樣，立正、站好</span><span style="font-family:&quot;Arial&quot;,sans-serif" lang="EN-US">!<o:p></o:p></span></p><p></p>\n                </div>\n                                                </div>\n                                            </div>\n                                      <!--div class="container"></div-->\n                        ', '2015-07-23 11:00:52'),
(1886, 163, 0, 0, 41, 'none', '{"0":"20150907110931530827.jpg","1":"20150907110934359084.jpg","2":"20150907110935730820.jpg","3":"2015090711093951811.jpg","4":"2015090711093954780.jpg","5":"2015090711093958817.jpg"}', '{"0":"https://www.youtube.com/embed/O6uJ--8l2NU"}', 'pagicon.jpg', 80, 0, 2, '[]', 'Youtuber名人堂│頑GAME│人生就是要像遊戲般有樂趣才對', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" width="651" height="100%" img_index="0"></p><p>&nbsp;</p><p>成員：華森、鐵牛、聖結石</p><p>國籍／居住地／原籍：台灣</p><p>YouTube年資：2014年 - 現在</p><p>訂閱人數：約300,570人(截至201509月)</p><p>&nbsp;</p><p>Facebook 帳號：playthreesmallgame</p><p>Instagram帳號：playmallgames</p><p>YouTube 頻道：https://www.youtube.com/user/playthreesmallgames</p><p>&nbsp;</p><p>日復一日的上班下班、上課下課，是不是該找些樂子了？一起跟著頑GAME遊戲人生吧！</p><p>&nbsp;</p><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:645; text-align: center; margin-right: auto; margin-left: auto; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/O6uJ--8l2NU" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>&nbsp;</p><p>這些梗從小聽到大，聽都聽到爛了，路邊老闆娘真的每個都會帥哥美女耶！</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_1.jpg" alt="" width="651" height="100%" img_index="1"></p><p>&nbsp;</p><p>在還沒成立頻道前，2013年就入圍YouTube台灣年度十大喜劇，再來2014年藉由網路實境節目《戀愛不設線》獲得YouTube年度最佳合作無間獎，以及2014年YouTube 100,000訂閱大賞獎牌，看得出來他們真的是一個很棒的TEAM，2015年也獲得了第一季台灣YouTube最成功廣告排行第五名。</p><p>短短幾年就有那麼多的成果，頑GAME用遊戲人生的方式證明了，喜劇演員也可以玩得很開心、很快樂。</p><p>&nbsp;</p><p>&nbsp;<img style="max-width: 100%;" src="image_2.jpg" alt="" width="651" height="100%" img_index="2"></p><p>&nbsp;</p><p>短時間的成果並不會讓他們停止遊戲，反而更樂在其中，更努力發想要怎麼玩得更開心，讓大家也感染到他們愉快的氛圍。</p><p>&nbsp;</p><p><iframe src="https://www.youtube.com/embed/O6uJ--8l2NU" width="651" height="100%" allowfullscreen="allowfullscreen" frameborder="0"></iframe></p><p>&nbsp;</p><p>恐怖片就是有這些數不清的潛規則，全世界都只有他們會到沒訊號的地方，全世界只有他們會發現奇怪現象，恐怖片這樣還恐怖嗎？</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_3.jpg" alt="" width="651" height="100%" img_index="3"></p><p>&nbsp;</p><p>三個人之間就算再好，當彼此間遇到問題時還是得溝通得妥協，找到三個人之間的平衡點，因為他們是一個TEAM，不是獨自的三個個體，但藉由討論、溝通，總是會有個完美的結論。</p><p>&nbsp;</p><p>&nbsp;<img style="max-width: 100%;" src="image_4.jpg" alt="" width="650" height="100%" img_index="4"></p><p>&nbsp;</p><p>&nbsp;開心的到各個節目，一起為彼此也為粉絲們留下各種歡樂的回憶，喜劇演員就好像大家的開心果，更讓大家覺得他們怎麼都不累。</p><p>&nbsp;</p><p><iframe src="https://www.youtube.com/embed/YvLjdnUUsLI" width="651" height="100%" allowfullscreen="allowfullscreen" frameborder="0"></iframe></p><p>&nbsp;</p><p>&nbsp;誰沒當過小屁孩？誰沒白目過？這些屁孩做的事情我們好像也都做過啊！</p><p>&nbsp;</p><p>&nbsp;<img style="max-width: 100%;" src="image_5.jpg" alt="" width="650" height="100%" img_index="5"></p><p>&nbsp;</p><p>在搞笑影片爆炸多的YouTuber裡面，頑GAME就是用一種遊戲人生的態度讓支持他們的人，可以感受到從內心散發出來的快樂，就算成立不久而已，成功可以很迅速，但他們也是努力維持他們專業搞笑的形象給粉絲們。</p><p>想要為自己的人生多找些樂子就快點訂閱他們，一起頑GAME吧！</p>', '2015-09-07 09:38:14'),
(1853, 1610000235, 0, 0, 136, 'none', '{}', '{"0":"https://www.youtube.com/embed/PYKbZSvn4ew"}', 'pagicon.jpg', 57, 0, 2, '["小嵐","韓妞","超Cute眼妝","美妝"]', '美妝教學｜韓妞超可愛眼妝【跟小嵐一起變漂亮】', '', 0, '<p><div class="youtobe_video"><iframe style="max-width:100%;" width="560" height="315" src="https://www.youtube.com/embed/PYKbZSvn4ew" frameborder="0" allowfullscreen=""></iframe></div></p><p>韓國的妝容一直都是我的最愛，不管是韓國女星或是部落客雖然只是淡淡的輕透底妝，</p><p>眼睛不需要太多的眼影，也依然有一種把人吸進去的魔力！</p><p>今天就來教大家如何畫出迷人的<span style="color: #ff99cc;">韓風CUTE眼妝</span>！</p><p>&nbsp;</p>', '2015-08-07 20:30:36'),
