(1907, 161, 0, 0, 75, '', '{"0":"20151029084638305529.jpg","1":"20151029084638307413.jpg","2":"20151029084638308427.jpg","3":"20151029084638309416.jpg","4":"20151029084638310432.jpg","5":"20151029084638311419.jpg"}', '{}', 'pagicon.jpg', 32, 0, 4, '["蛋事","插畫家","插畫精選","生活","搞笑"]', '【蛋事】插畫精選(三)：當你和朋友分享自己最近達成的成就…', '', 0, '<p style="text-align: center;">&nbsp;1.我瘦了！</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.最香的花？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.被狗追到底是好事還壞事呢？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.什麼女人都敵不過女友啊~</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.好像沒有選擇的餘地？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.關於現代孩子的對話模式。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 10:09:15'),
(1900, 163, 0, 0, 171, '', '{"0":"20151023102237402770.jpg","1":"20151023102237404350.jpg","2":"20151023102237405147.png","3":"20151023102237406066.png","4":"20151023102237406775.png","5":"20151023102237407473.png","6":"20151023102237408267.png","7":"20151023102237408981.png","8":"20151023102237409626.png","9":"20151023102237410394.png","10":"20151023102237411173.png","11":"20151023102237412153.png","12":"20151023102237413097.png","13":"20151023102237414013.png","14":"20151023102237415570.jpg","15":"20151023102237416359.png","16":"20151023102237417136.jpg","17":"20151023102237417870.jpg","18":"20151023102237418744.jpg"}', '{"0":"https://www.youtube.com/embed/ycexcet9yJQ"}', 'pagicon.png', 40, 0, 46, '[]', '【插畫名人堂】三隻熊畫出你我的戀愛小滋味', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" width="621" height="100%" img_index="0"></p><p>&nbsp;</p><p>一、基本資料</p><p>&nbsp;<img style="max-width: 100%;" src="image_1.jpg" alt="" width="450" height="100%" img_index="1"></p><p>本名：陳偉愷</p><p>國籍／居住地／原籍：台灣</p><p>Facebook年資： 2014年9月15日 – 至今</p><p>粉絲人數：139,957人 (截至151013)</p><p>&nbsp;</p><p>Facebook 帳號：<a href="https://www.facebook.com/lllbears">lllbears</a></p><p>Instagram帳號： <a href="https://instagram.com/rnr.d/">rnr.d</a></p><p>&nbsp;</p><p>二、簡介</p><p>&nbsp;<img style="max-width: 100%;" src="image_2.png" alt="" width="400" height="100%" img_index="2"></p><p>　三隻熊Mr.D是黑熊、白熊和貓熊的組合，作品的主人是從平面設計轉往插畫世界的陳偉愷(以下稱Mr.D)。跟大部分臉書插畫家不同的是，Mr.D是先創作出LINE貼圖獲得許多人喜愛，進而成立臉書粉絲專頁。三隻熊也讓Mr.D更確定自己是要走插畫這個方向，透過插畫讓自己更有目標的朝好的方向前進。</p><p><img style="max-width: 100%;" src="image_3.png" alt="" width="400" height="100%" img_index="3"></p><p>　↑農曆七月的熊貓哥。</p><p><img style="max-width: 100%;" src="image_4.png" alt="" width="400" height="100%" img_index="4"></p><p>　↑呼應美國通過同性法案的熊貓哥。</p><p><img style="max-width: 100%;" src="image_5.png" alt="" width="400" height="100%" img_index="5"></p><p>　↑也會泛舟的熊貓哥。</p><p>　三隻熊主要有「黑熊哥」、「白熊妹」和「熊貓哥」，有著嬌嫩腮紅的熊貓哥是三隻熊中最受粉絲喜歡的，可能它結合了黑熊、白熊，所以相較之下成了更討喜的主角風格。</p><p>&nbsp;</p><p>三、插畫風格</p><p>　三隻熊的取材風格大部分是一些語錄系列創作，無論是心情、愛情和友情都可以從圖文作品看到，有時候也會有網路爆紅的事件及生活上熱門的話題，除了給粉絲們看了笑笑以外，也給了一個沉澱心靈的小平台。</p><p>&nbsp;<img style="max-width: 100%;" src="image_6.png" alt="" width="350" height="100%" img_index="6"></p><p>　↑冷笑話的熊貓哥。</p><p><img style="max-width: 100%;" src="image_7.png" alt="" width="350" height="100%" img_index="7"></p><p>　↑非常會冷笑話的熊貓哥。</p><p><img style="max-width: 100%;" src="image_8.png" alt="" width="350" height="100%" img_index="8"></p><p>　↑真的非常會冷笑話的熊貓哥。</p><p>　熊貓哥的搞笑真的讓人招架不住，會有各種冷冷的梗，不然就是很欠揍的好笑，在溫馨可愛的三隻熊又能讓人會心一笑。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_9.png" alt="" width="400" height="100%" img_index="9"></p><p>　↑就是有個人在身邊默默地付出。</p><p><img style="max-width: 100%;" src="image_10.png" alt="" width="400" height="100%" img_index="10"></p><p>　↑有時候沉默才是最難過的。</p><p><img style="max-width: 100%;" src="image_11.png" alt="" width="400" height="100%" img_index="11"></p><p>　↑別讓愛的人有太多算了的念頭吧。</p><p>　戀愛中總是會有一堆心中小劇場，三隻熊就讓你看到各種酸甜苦辣的滋味。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_12.png" alt="" width="400" height="100%" img_index="12"></p><p>　↑用心才能看見真正重要的東西。</p><p><img style="max-width: 100%;" src="image_13.png" alt="" width="400" height="100%" img_index="13"></p><p>　↑別人說的不一定事實要自己求證才對。</p><p><img style="max-width: 100%;" src="image_14.jpg" alt="" width="400" height="100%" img_index="14"></p><p>　↑人生不長也不短，不管什麼事情都要即時，尤其是愛。</p><p>　除了愛情、趣味之外，人生有很多不同的狀況，透過三隻熊詮釋出各種有意義的話，讓語錄不只是單調的語錄，也讓人想一看再看。</p><p>&nbsp;</p><p>四、熱門影音作品</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/lllbears/videos/vb.889700194376809/1096343650379128/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/lllbears/videos/1096343650379128/"><a href="https://www.facebook.com/lllbears/videos/1096343650379128/">明明說好不放手</a><p>明明說好不放手.合作頻道:台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/lllbears">三隻熊Mr.D</a> on Tuesday, September 1, 2015</blockquote></div></div><p>&nbsp;</p><p>　明明說好不放手這部影片已經超過百萬的觀看次數，話題切中粉絲們的心，萬人以上按讚沒有什麼大不了，可是有將近1萬5千的臉書分享次數，就看得出來畫得多貼切語錄又多打動人心。</p><p>&nbsp;</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/lllbears/videos/vb.889700194376809/979661955380632/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/lllbears/videos/979661955380632/"><p>三隻熊的第一支動畫短片來嚕～片名「最珍貴的寶物」要送給各位粉絲朋友，希望你們會喜歡 ! (之後還會陸續推出^^).淵仔是mr.d最近認識的達人呦！年紀輕卻能做出很有質感的動畫短片，把圖畫跟文字結合的感動表達的很棒，非常感謝這一次跟他的動畫共同創作 !.動畫創意合作請洽信箱：jeanwang@ttshow.tw電話：(02)2370-3758#118</p>Posted by <a href="https://www.facebook.com/lllbears">三隻熊Mr.D</a> on Wednesday, February 18, 2015</blockquote></div></div><p>&nbsp;</p><p>　三隻熊的第一部影片，是要大家好好珍惜身邊的人，日久不一定生情，但一定見人心，讓大家知道什麼是最珍貴的寶物。</p><p>&nbsp;</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/lllbears/videos/vb.889700194376809/1112557575424402/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/lllbears/videos/1112557575424402/"><a href="https://www.facebook.com/lllbears/videos/1112557575424402/">這樣就不孤單了嗎？XD</a><p>孤單時要喝汽水合作頻道:台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/lllbears">三隻熊Mr.D</a> on Thursday, October 1, 2015</blockquote></div></div><p>&nbsp;</p><p>　喝汽水就可以不孤單？三隻熊用KUSO的方式讓大家多喝汽水這樣就不會孤單了，網友們也留言說這樣每天都要喝汽水了，用小趣味得到不少共鳴。</p><p>&nbsp;</p><p>五、外部連結</p><p>&nbsp;</p><ol><li><a href="https://store.line.me/stickershop/product/4892/zh-Hant">LINE原創貼圖</a></li></ol><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/lllbears/videos/vb.889700194376809/1066509663362527/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/lllbears/videos/1066509663362527/"><p>三隻熊二代LINE動貼圖「三隻熊愛耍LINE」來嚕～趕快到LINE貼圖小鋪找我玩～不見不散呦!!!!!.合作頻道：台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/lllbears">三隻熊Mr.D</a> on Wednesday, July 15, 2015</blockquote></div></div><p>　</p><ol start="2"><li><a href="https://www.esliteliving.com/news/news_detail.aspx?a=TW&amp;l=b&amp;flag=NA&amp;class=&amp;no=201510040002">誠品生活│圖文作家看Shopping fever</a></li></ol><p><img style="max-width: 100%;" src="image_15.png" alt="" width="620" height="100%" img_index="15"></p><p>　在誠品生活的活動中也能夠看到三隻熊，從三隻熊看看周年慶來了，會有那些購物現象，有多位插畫家共同參與，看看Mr.D畫出來的三隻熊們有什麼可愛的表現吧！</p><p>&nbsp;</p><ol start="3"><li><a href="https://youtu.be/ycexcet9yJQ">網路溫度計-插畫部落客</a></li></ol><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/ycexcet9yJQ" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>&nbsp;<img style="max-width: 100%;" src="image_16.jpg" alt="" width="449" height="100%" img_index="16"></p><p><img style="max-width: 100%;" src="image_17.jpg" alt="" width="450" height="100%" img_index="17"></p><p><img style="max-width: 100%;" src="image_18.jpg" alt="" width="450" height="100%" img_index="18"></p><p>&nbsp;</p><p>看更多三隻熊Mr.D的經典作品</p><p>&nbsp;</p><p>動畫合集(一)：</p><p>動畫合集(二)：</p><p>插畫合集(一)：</p>', '2015-10-14 09:29:29'),
(1895, 163, 0, 0, 171, '', '{"0":"20151023101503852315.jpg","1":"20151023101503855344.jpg","2":"20151023101503856668.jpg","3":"20151023101503857952.jpg","4":"20151023101503859351.jpg","5":"20151023101503860635.jpg","6":"20151023101503861964.jpg","7":"20151023101503863381.jpg","8":"20151023101503864559.jpg","9":"20151023101503865516.jpg","10":"20151023101503866298.jpg","11":"20151023101503867208.jpg","12":"20151023101503868142.jpg"}', '{"0":"https://www.youtube.com/embed/XBBLij7XHug","1":"https://www.youtube.com/embed/wwHbMrZ-tZ0","2":"https://www.youtube.com/embed/yAk1EA1mUpk","3":"https://www.youtube.com/embed/-reqZIE_DSg","4":"https://www.youtube.com/embed/qzlOutZd7ao","5":"https://www.youtube.com/embed/P76Du-xHIM8"}', 'pagicon.jpg', 108, 0, 46, '[]', '【Youtuber名人堂】誰都阻擋不了的愛演人生─這群人TGOP', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" width="620" height="100%" img_index="0"></p><p>成員：陰森、基榮、瑞室、石頭、董仔、尼克、木星</p><p>國籍／居住地／原籍：台灣</p><p>YouTube年資： 2008年 - 現在</p><p>訂閱人數：約851,397人 (截至1041001)</p><p>&nbsp;</p><p>Facebook 帳號：<a href="https://www.facebook.com/thisgroupofpeople/">thisgroupofpeople</a></p><p>Instagram帳號：瑞室 <a href="https://instagram.com/mondayhsu/">mondayhsu</a>、石頭 prieev、董仔 <a href="https://instagram.com/donehannah/">donehannah</a>、陰森 <a href="https://instagram.com/ferrtsss/">ferrtsss</a>、基榮、<a href="https://instagram.com/arongxu1/">arongxu1</a>、尼克 <a href="https://instagram.com/nickwang1988">nickwang1988</a>、木星 <a href="https://instagram.com/gillingraze">gillingraze</a></p><p>YouTube 頻道：<a href="https://www.youtube.com/user/e84768131">https://www.youtube.com/user/e84768131</a></p><p>&nbsp;<img style="max-width: 100%;" src="image_1.jpg" alt="" width="620" height="100%" img_index="1"></p><p>&nbsp;說到Youtube紅人，不能不提到訂閱人數、影片點閱數都數一數二的網路搞笑天團<span style="color: #3366ff;">「這群人」</span>。</p><p>&nbsp;</p><p>&nbsp;<div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/XBBLij7XHug" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>↑ 當年紅翻全球的PSY江南大叔騎馬舞，也成為<span style="color: #3366ff;"><strong>這群人</strong></span>的創作題材，將<span style="color: #ff0000;">歌曲改編成中文，還拍了惡搞MV吸引網友大量點閱，點閱率高達5百萬！</span>誇張的表情、精彩舞蹈排場和洗腦的惡搞歌詞，每個環節都深入網友腦中，讓人笑到噴淚。</p><p>&nbsp;<img style="max-width: 100%;" src="image_2.jpg" alt="" width="620" height="100%" img_index="2"></p><p><span style="color: #3366ff;"><strong>這群人</strong>是由雙胞胎基榮和瑞室、陰森、董仔、木星、尼克還有石頭組合而成的超搞笑團體。</span>從2008年就以拍攝<span style="color: #ff0000;">各種搞笑影片在YouTube嶄露頭角</span>，將愛演的特色用獨特搞笑又誇張的風格讓大家記住他們，<span style="color: #ff0000;">經典的幾部影片擁有百萬起跳的點閱率</span>，也讓更多人看到他們的精彩表現。</p><p>而且<span style="color: #ff0000;"><span style="color: #333333;">無論是在YouTube頻道還是臉書粉絲專頁都可以看到擁有大量粉絲，</span>每位成員沒有距離感更具有親和力，也擅長與粉絲們互動</span>。</p><p>&nbsp;</p><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/wwHbMrZ-tZ0" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>↑ 網路上爆紅的分手擂台「淡定紅茶」的故事，這群人也馬上跟上腳步，直接真人翻拍演出，達成了將近4百萬的點閱率、快2千則的網友留言討論。</p><p>幾乎<span style="color: #333333;">把網路上的文字故事完美呈現，甚至加了不少讓人笑到噴淚的情節，像是<span style="color: #3366ff;">淡定哥<strong>瑞室</strong>的表情直接用膠帶貼<strong>「ˊ_&gt;ˋ」</strong></span>，就算醜也要給</span>大家看看什麼是淡定，<span style="color: #3366ff;">激動妹的<strong>陰森</strong>也不斷地重複「你騙人」、「為什麼要跟我分手」配上許多誇張行為只是為了要淡定哥做出些反應</span>。</p><p>&nbsp;</p><p>&nbsp;<img style="max-width: 100%;" src="image_3.jpg" alt="" width="620" height="100%" img_index="3"></p><p><img style="max-width: 100%;" src="image_4.jpg" alt="" width="620" height="100%" img_index="4"></p><p><img style="max-width: 100%;" src="image_5.jpg" alt="" width="620" height="100%" img_index="5"></p><p>　<span style="color: #3366ff;"><strong>這群人</strong></span>的招牌人物<span style="color: #3366ff;"><strong>基榮、瑞室</strong></span>，雙胞胎的兩個人不只是外表長得一樣，更是共同熱衷於演戲這件事，也喜歡問大家分不分得出來他們，因為真的太像了。<span style="color: #ff0000;">雙胞胎就已經很不容易了，沒想到兩個還都很愛演，注定就是要彼此當兄弟，少了其中一個都不行。</span></p><p><img style="max-width: 100%;" src="image_6.jpg" alt="" width="620" height="100%" img_index="6"></p><p><img style="max-width: 100%;" src="image_7.jpg" alt="" width="620" height="100%" img_index="7"></p><p>說到<span style="color: #3366ff;">最佳女主角不能不提到從<strong>淡定的最高境界</strong>爆紅的<strong>陰森</strong></span>，藉由「激動妹」誇張的表現把女生一些較神經質的特色表現出來<span style="color: #333333;">，<strong>陰森</strong>在影片中除了將她的愛演展現地淋漓盡致，更不計形象地溢出滿滿的表演熱忱。但其實</span>陰森很女人也很可愛，剪了空氣瀏海的<strong>陰森</strong>還跟韓國可愛的朴寶英有明星臉。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_8.jpg" alt="" width="620" height="100%" img_index="8"></p><p><img style="max-width: 100%;" src="image_9.jpg" alt="" width="620" height="100%" img_index="9"></p><p>這群人裡面除了雙胞胎帥哥外，還有另外兩位帥哥尼克、石頭。尼克有個不少人都要抬頭看他的身高，而這副帥氣皮囊下有著愛演的內心。而要讓這群人被大家看到就要有個好的攝影師，石頭在這群人中扮演多重要的角色，這群人不管是照片還是影片大多出自他的專業。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_10.jpg" alt="" width="620" height="100%" img_index="10"></p><p><img style="max-width: 100%;" src="image_11.jpg" alt="" width="620" height="100%" img_index="11"></p><p><span style="color: #3366ff;"><strong>這群人</strong></span>裡面除了帥哥外，女生也都是美女。除了<strong>陰森</strong>以外，還有<span style="color: #3366ff;"><strong>木星、董仔。</strong><span style="color: #333333;"><span style="color: #3366ff;">木星</span>是個</span></span><span style="color: #333333;">臉上總是掛著笑容，給人一種溫暖感覺的女孩</span>；<span style="color: #3366ff;"><strong>董仔</strong><span style="color: #333333;">是從高中、大學就和<strong>陰森</strong>、<strong>基榮</strong>和<strong>瑞室</strong>當同學，是最初<strong>這群人</strong>組成的團員之一</span></span><span style="color: #333333;">。</span></p><p>&nbsp;</p><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/yAk1EA1mUpk" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>&nbsp;</p><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/-reqZIE_DSg" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>↑ 大家不管讀書到哪個階段都當過學生，學生的經典語錄你說過哪些？還有上學時坐在座位上看著每位老師好像都講差不多的話，看到老師的經典語錄是不是<span style="color: #3366ff;">勾起了求學階段的回憶</span>？</p><p><span style="color: #ff0000;"><strong>這群人</strong>集結了各種老師、學生們愛說、常說的經典話，不然就是會做的事情，</span>可以從愛演的他們，得到不少開心的笑聲。無論是<span style="color: #3366ff;">老師好像教的所有東西都是重點這邊都會考，還是女生們去上廁所一定要成群結隊，男生打瞌睡被叫罰站不能馬上站直</span>，這些就與我們以前的生活幾乎如出一轍。</p><p>&nbsp;</p><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/qzlOutZd7ao" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>↑ 早上起床半睡半醒間總是不經意說出了些自己都不記得的話，<span style="color: #ff0000;"><strong>這群人</strong>直接演出來給你看這些我們做過的事情</span>，無論是家人明明有叫你起床自己賴床還怪家人，不然就是鬧鐘設定每5分鐘響一次，還有一定要叫旁邊的人先起床自己多睡幾分鐘都開心。<strong>這群人</strong>早上起床的經典語錄，看了讓人每天早上起床都自動聯想到各種不同的起床反應。</p><p>&nbsp;</p><p>&nbsp;<span style="color: #3366ff;"><strong>這群人</strong></span>的影片靈感都是取自於生活中的小事情，將它「小題大作」，讓人看了會有感同身受的感覺。影片作品有許多不同的系列，<span style="color: #ff0000;">主打兩個系列分別是「經典語錄」、「偽電影預告片」。</span>語錄系列以我們日常生活中可能會遇到的狀況，把它誇張搞笑化的演出來，像是有家人語錄、服務生語錄等；偽電影系列則是惡搞拍出好笑的預告片，但其實根本沒有完整的電影，有跟鯰魚哥合作的布丁俠或是男人幫：陰經傳說3D等。</p><p>&nbsp;</p><p>&nbsp;<img style="max-width: 100%;" src="image_12.jpg" alt="" width="620" height="100%" img_index="12"></p><p>現在不只在<strong>這群人</strong>的YouTube頻道才看得到他們，走紅程度讓越來越多人知道他們的近況，也讓大家可以在各種不同的電視節目看到<span style="color: #3366ff;"><strong>這群人</strong></span>的身影，就算不是7個人一起出演，但不時地依然能夠看到<span style="color: #3366ff;"><strong>基榮、瑞室或陰森</strong></span>，他們種種努力已經是受到肯定的。</p><p>暑假<span style="color: #ff0000;">最夯國片「我的少女時代」</span>裡面，也看得到基榮(林真心的哥哥)和陰森(林真心同班同學)的身影。<span style="color: #3366ff;">電視劇妹妹、一代新兵之八極少年也都看得到這群人裡面的【三個人】<strong>基榮、瑞室和陰森，</strong>他們的實力是可以搬上螢幕的。</span></p><p>&nbsp;</p><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/P76Du-xHIM8" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>↑ 最後，讓我們聽聽由<span style="color: #ff0000;"><strong>這群人</strong>的核心基榮、瑞室和陰森組成的<strong>【三個人】</strong>所唱的這群人主題曲<strong>『皮在癢』</strong></span>，原來他們不只會演會跳，沒想到也會唱。而且居然是由他們<span style="color: #3366ff;">自己填詞</span>唷！</p><p>&nbsp;</p>', '2015-10-05 08:25:52'),
(1905, 161, 0, 0, 75, '', '{"0":"20151029084531194486.jpg","1":"20151029084531196234.jpg","2":"20151029084531197321.jpg","3":"20151029084531198326.jpg","4":"20151029084531199468.jpg","5":"20151029084531200375.jpg"}', '{}', 'pagicon.jpg', 42, 0, 4, '["蛋事","插畫家","插畫精選","生活","搞笑"]', '【蛋事】插畫精選(一)：你的生活周遭有沒有這樣的人存在...', '', 0, '<p style="text-align: center;">&nbsp;1.要借衛生紙時。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.愛問鬼問題整朋友。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.問時間的時候…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.不說的話幹嘛提阿！</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.話都不講完的。</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.有些小孩真的是奇行種來著…</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 09:03:31');
INSERT INTO `page` (`page_id`, `user_id`, `special_tag_id`, `checker_id`, `channel_id`, `display`, `photo_list`, `movie_list`, `article_icon`, `c_num_click`, `share_num`, `class`, `tag`, `title`, `describe`, `appraisal`, `html`, `date`) VALUES
(1896, 163, 0, 0, 171, '', '{"0":"20151012143503323954.jpg","1":"20151012143506179013.jpg","2":"20151012143508689792.jpg","3":"20151012143511193387.jpg","4":"20151012143511194550.jpg","5":"20151012143511195765.jpg","6":"20151012143511196880.jpg","7":"20151012143511198054.jpg","8":"20151012143511199053.jpg","9":"20151012143511200140.jpg","10":"20151012143511201098.jpg","11":"20151012143511202262.jpg"}', '{}', 'pagicon.jpg', 129, 0, 46, '[]', '【插畫名人堂】最強18歲屁孩網路插畫家─EggThings蛋事', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" width="620" height="100%" img_index="0"></p><p><strong><span style="font-size: 18pt;">一、基本資料</span></strong></p><blockquote><p>名稱：蛋哥</p><p>國籍／居住地／原籍：台灣</p><p>Facebook年資：2014/08/02 – 現在</p><p>粉絲人數：296,153人 (截至151007)</p></blockquote><blockquote><p>Facebook 帳號：</p><div class="fb-page" data-href="https://www.facebook.com/eggthings" data-width="100" data-small-header="true" data-adapt-container-width="false" data-hide-cover="false" data-show-facepile="false" data-show-posts="false"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/eggthings"><a href="https://www.facebook.com/eggthings">EggThings蛋事</a></blockquote></div></div><p>Twitter 帳號： <a href="https://twitter.com/egg_things">egg_things</a></p><p>Instagram帳號： <a href="https://instagram.com/egg_things">egg_things</a></p></blockquote><p>&nbsp;</p><p>&nbsp;<img style="max-width: 100%;" src="image_1.jpg" alt="" width="500" height="100%" img_index="1"></p><p><strong><span style="font-size: 18pt;">二、簡介</span></strong></p><p><span style="color: #3366ff;"><strong>「EggThings蛋事」</strong></span>是由臉書插畫家<span style="color: #3366ff;"><strong>蛋哥</strong></span>創作源源不絕的地方，而蛋事就是指跟雞蛋一般小的蠢事、趣事，用詼諧風趣的畫風，主題是一些生活中的小事。蛋哥<span style="color: #ff0000;">抱持著「人不屁孩枉少年」的態度</span>，讓畫出來的東西能讓自己、粉絲們看了都會心一笑。</p><p>臉書粉絲專頁「EggThings蛋事」成立於2014年8月，蛋哥的<span style="color: #3366ff;">作品系列主要以諧音梗、屁孩行為和嘴賤的那一面</span>，在粉絲專頁成立一年多已經有<span style="color: #ff0000;">將近30萬的粉絲</span>，一有新的作品，留言及分享都依然相當熱烈。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_2.jpg" alt="" width="500" height="100%" img_index="2"></p><p><img style="max-width: 100%;" src="image_3.jpg" alt="" width="500" height="100%" img_index="3"></p><p>蛋哥畫的<span style="color: #3366ff;">人物是真實存在的，並不是虛構</span>，蛋哥就是他本人，蛋姊是女朋友所以常常畫放閃系列，常常被欺負的朋友A也是蛋哥的好友。粉專分享他們一起吃飯畫面key上蛋哥畫的版本，讓粉絲覺得<span style="color: #ff0000;">說不定「EggThings蛋事」裡面的人物可能就在你身邊</span>。</p><div id="fb-root">&nbsp;</div><p><span style="font-size: 18pt;"><strong>三、插畫風格</strong></span></p><p>&nbsp;<img class="aligncenter" style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p>&nbsp;</p><p><img class="aligncenter" style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p><p>蛋哥的取材主題也會是一些<strong><span style="color: #3366ff;">時事</span></strong>，像是暑假很夯國片《我的少女時代》、颱風假天氣卻莫名好得不得了、中秋節跟朋友烤肉。再從時事話題融合自身的屁孩、嘴賤風格。</p><p>&nbsp;<img style="max-width: 100%;" src="image_6.jpg" alt="" width="350" height="100%" img_index="6"></p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_7.jpg" alt="" width="350" height="100%" img_index="7"></p><p>在不同系列作品中<span style="color: #3366ff;">朋友A幾乎都會是蛋哥揶揄、捉弄的對象，蛋哥用嘴賤趣味的風格跟朋友A的互動，是粉專上最常見的作品</span>，讓粉絲們除了看得開心外，說不定還能學習蛋哥幽默的開玩笑手法。</p><p>&nbsp;<img style="max-width: 100%;" src="image_8.jpg" alt="" width="350" height="100%" img_index="8"></p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_9.jpg" alt="" width="350" height="100%" img_index="9"></p><p>&nbsp;</p><p>&nbsp;</p><p>既然抱持著「人不屁孩枉少年」的精神在創作每一個作品，所以<span style="color: #3366ff;">不少作品是讓人看了會馬上覺得「天啊！怎麼會那麼屁孩？」的想法</span>，蛋哥畫的有些行為，是以每個人可能在學生時期會做的一些屁孩事，碰巧蛋哥現在還是大學生，所以總是能<strong><span style="color: #ff0000;">一筆畫中粉絲們的點</span></strong>。</p><p>&nbsp;</p><div><strong><span style="font-size: 18pt;">四、熱門影音作品</span></strong></div><div>&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/eggthings/videos/vb.804595382907841/1028119977222046/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/eggthings/videos/1028119977222046/"><p>EggThings蛋事熱門諧音梗影片系列!!開心的回顧一下吧~~請開聲音~</p>Posted by <a href="https://www.facebook.com/eggthings">EggThings蛋事</a> on Saturday, September 5, 2015</blockquote></div></div><p>&nbsp;</p><p>↑ 熱門諧音梗影片系列，將4部觀看人數、按讚人數都很熱門的諧音梗短片結合在一起。諧音梗常常讓人不禁笑了出來，或許第一時間沒會過意，看了第二遍、第三遍就會忍不住笑了。</p><div class="fb-video" data-allowfullscreen="1" data-href="/eggthings/videos/vb.804595382907841/939732116060833/?type=3"><div class="fb-xfbml-parse-ignore"><div class="fb-video" data-allowfullscreen="1" data-href="/eggthings/videos/vb.804595382907841/939732116060833/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote><p>諧音梗小短片4浪漫的邂逅 王力宏 Wang Leehom你的愛(這次不會拖太久唷!!)合作頻道 台灣達人秀</p></blockquote></div></div><div class="fb-video" data-allowfullscreen="1" data-href="/eggthings/videos/vb.804595382907841/939732116060833/?type=3"><blockquote><div class="fb-xfbml-parse-ignore">Posted by <a href="https://www.facebook.com/eggthings">EggThings蛋事</a> on Thursday, April 2, 2015</div></blockquote></div><p>↑ 浪漫的邂逅也可以變成好笑的諧音梗，<span style="color: #ff0000;">高達<strong>60萬</strong>的觀看次數，是粉專最熱門的影片，還有<strong>2千多則</strong>網友們熱情討論留言，更有近萬人分享。</span>蛋哥的作品總是戳中粉絲們的點，讓大家忍不住跟自己的朋友分享。</p><div class="fb-video" data-allowfullscreen="1" data-href="/eggthings/videos/vb.804595382907841/1020984037935640/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote><p>諧音梗影片系列~阿姨的無理要求合作頻道: 台灣達人秀插畫</p></blockquote></div></div><div class="fb-video" data-allowfullscreen="1" data-href="/eggthings/videos/vb.804595382907841/1020984037935640/?type=3"><blockquote><div class="fb-xfbml-parse-ignore">Posted by <a href="https://www.facebook.com/eggthings">EggThings蛋事</a> on Monday, August 24, 2015</div></blockquote></div><p>↑ 阿姨的無理要求也是蛋哥相當擅長的諧音梗系列影片，有35萬人觀看次數、快2萬人按讚。其實影片除了諧音梗以外，更加入一些小不合理的地方，像是滿滿的冰箱裡面居然有字典，<span style="color: #ff0000;">讓粉絲們玩玩大家來找碴，所以在1千多則留言裡面有好多粉絲都說「冰箱裡為什麼有字典？」</span>，這就是蛋哥風趣搞怪的地方。</p></div></div><p>&nbsp;</p><p><span style="font-size: 18pt;"><strong>五、外部連結</strong></span></p><p>&nbsp;<img style="max-width: 100%;" src="image_10.jpg" alt="" width="620" height="100%" img_index="10"></p><p><img style="max-width: 100%;" src="image_11.jpg" alt="" width="620" height="100%" img_index="11"></p><p><a href="https://store.line.me/stickershop/product/1152510/zh-Hant">LINE貼圖傳送門</a></p><p>在<strong><span style="color: #3366ff;">LINE的原創貼圖也能夠買到蛋哥的創作</span></strong>，喜歡蛋哥蛋姊放閃，或是喜歡看到朋友A被捉弄，心動不如馬上行動。</p><p>&nbsp;</p><p><strong>○看更多EggThings經典作品</strong></p><blockquote><p>動畫合集(一)：page-inner.php?page_id=1896</p><p>動畫合集(二)：page-inner.php?page_id=1896</p><p>插畫合集(一)：page-inner.php?page_id=1896</p></blockquote><p>&nbsp;</p>', '2015-10-08 08:30:01'),
(2013, 161, 0, 0, 126, '', '{"0":"20151029091621756559.jpg","1":"20151029091621758406.jpg","2":"20151029091621759542.jpg","3":"20151029091621760560.jpg","4":"20151029091621761559.jpg","5":"20151029091621762589.jpg"}', '{}', 'pagicon.jpg', 18, 0, 4, '["Lon-設計是空","插畫精選","插畫家","生活","兩性"]', '【Lon-設計是空】插畫精選(四)：色瞇瞇的男生最差勁了!', '', 0, '<p style="text-align: center;">&nbsp;1.色瞇瞇的男生最差勁了!</p><p style="text-align: center;">&nbsp;<img style="max-width: 100%;" src="image_0.jpg" alt="" width="400" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;&nbsp;</p><p style="text-align: center;">2.戒菸</p><p style="text-align: center;">&nbsp;<img style="max-width: 100%;" src="image_1.jpg" alt="" width="399" height="100%" img_index="1"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.關於初音</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="400" height="100%" img_index="2">&nbsp;</p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.健康捐上漲</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="400" height="100%" img_index="3">&nbsp;</p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.哪顆排球是你的呢?</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="400" height="100%" img_index="4">&nbsp;</p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.所謂"有點肉"的女生</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="400" height="100%" img_index="5">&nbsp;</p>', '2015-10-23 10:52:24'),
(1928, 163, 0, 0, 37, '', '{"0":"20151019090717954164.jpg","1":"20151019090717956792.jpg","2":"20151019090717958221.jpg","3":"20151019090717959771.jpg","4":"20151019090717960844.jpg","5":"20151019090717961909.jpg","6":"20151019090717963373.jpg","7":"20151019090717964656.jpg","8":"20151019090717965817.jpg","9":"20151019090717967190.jpg","10":"20151019090717968357.jpg","11":"20151019090717969726.jpg","12":"20151019090717971276.jpg"}', '{}', 'pagicon.jpg', 39, 0, 4, '[]', '【插畫名人堂】愛牠的不完美 「狗與鹿」筆下毛小孩的話', '', 0, '<p><img style="max-width: 100%;" src="image_0.jpg" alt="" width="619" height="100%" img_index="0"></p><p>&nbsp;一、基本資料</p><p><img class="aligncenter" style="max-width: 100%;" src="image_1.jpg" alt="" width="399" height="100%" img_index="1"></p><p><img style="max-width: 100%;" src="image_2.jpg" alt="" width="499" height="100%" img_index="2"></p><p>名稱：狗與鹿(James)</p><p>國籍／居住地／原籍：台灣</p><p>Facebook年資：2014年7月11日 – 至今</p><p>粉絲人數：303,308人 (截至151016)</p><p>&nbsp;</p><p>Facebook 帳號： <a href="https://www.facebook.com/MYDEERDOG/">MYDEERDOG</a></p><p>Instagram帳號： <a href="https://instagram.com/mydeerdog/">mydeerdog</a></p><p>&nbsp;</p><p>&nbsp;</p><p>二、簡介</p><p><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p>　網路迅速爆紅臉書粉絲專頁「狗與鹿」，作者是用自身養寵物經驗的James。當初本來是要畫跟女朋友的大小事，或是像插畫家世界第一批爆紅的掰掰啾啾、DuncanDesigh那樣好笑的東西，但發現已經飽和了，決定改畫有特色又溫馨的寵物，「狗與鹿」就這樣誕生了。</p><p><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p><p>　James有一隻養了17年的柴犬，因為自身多年養寵物的經驗，也是呼籲「領養代替購買」的發聲者，更幫助流浪毛小孩發聲，讓大量愛寵物的粉絲們喜歡上這個溫馨的平台。當初一成立不到半年就有24萬粉絲人數，每則動態也有一定的分享、按讚數量。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;三、插畫風格</p><p>&nbsp;</p><p>　從狗狗的角度說的話來傳達人與人或是人與狗或是狗與狗相處看法，有各種不同的溫馨話語或是警惕人們的話，可以看到主人與寵物之間的各種互動，也能夠更重視毛小孩的成長與陪伴牠們的時間，而常常因為一些小語錄就讓網友們飆淚，還要透過作品讓討厭動物的人放下成見，去愛惜身邊的每一個生命。</p><p><img style="max-width: 100%;" src="image_6.jpg" alt="" width="350" height="100%" img_index="6"></p><p>↑對毛小孩來說，主人的身邊就是最有保障的地方。</p><p><img style="max-width: 100%;" src="image_7.jpg" alt="" width="350" height="100%" img_index="7"></p><p>↑毛小孩陪著我們長大，但卻往往不能陪我們到老。</p><p><img style="max-width: 100%;" src="image_8.jpg" alt="" width="350" height="100%" img_index="8"></p><p>↑毛小孩每個階段的毛毛都是有意義的。</p><p><img style="max-width: 100%;" src="image_9.jpg" alt="" width="351" height="100%" img_index="9"></p><p>↑其實毛小孩們比想像中的還容易滿足，給牠一個家牠就認定是一輩子了。</p><p><img style="max-width: 100%;" src="image_10.jpg" alt="" width="350" height="100%" img_index="10"></p><p>↑毛小孩們壽命與人不一樣，所以更要珍惜能陪伴牠的時間。</p><p>&nbsp;</p><p>四、熱門影音作品</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/MYDEERDOG/videos/vb.1456942691228969/1594200534169850/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/MYDEERDOG/videos/1594200534169850/"><p>愛牠 就愛牠的缺點吧 !Instagram id : mydeerdog https://instagram.com/mydeerdog/合作頻道 : 台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/MYDEERDOG">狗與鹿</a> on Thursday, April 23, 2015</blockquote></div></div><p>　不要嫌棄牠的缺點，愛牠就是好的不好的都愛，愛牠的不完美。得到33萬的觀看次數，更有4千多則分享。</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/MYDEERDOG/videos/vb.1456942691228969/1589978691258701/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/MYDEERDOG/videos/1589978691258701/"><p>【開始流浪】每個被拋棄的毛孩子都會學著自己成長學著找吃的 學著取暖 學著沒有主人的一生狗與鹿 x 六指淵 Huber 最新短篇動畫~~~~ 【狗與鹿IG】 : mydeerdog https://instagram.com/mydeerdog/合作頻道 : 台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/MYDEERDOG">狗與鹿</a> on Monday, April 13, 2015</blockquote></div></div><p>　除了支持認養代替購買以外，大家也別忘了領養也別棄養，毛小孩被拋棄後的生活可是很困難的，得吃垃圾、露宿街頭，甚至可能要和其他毛小孩搶食物，所以更要好好愛你的毛小孩。</p><p>&nbsp;</p><div class="fb-video" data-allowfullscreen="1" data-href="/MYDEERDOG/videos/vb.1456942691228969/1589978691258701/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/MYDEERDOG/videos/1589978691258701/"><p>【開始流浪】每個被拋棄的毛孩子都會學著自己成長學著找吃的 學著取暖 學著沒有主人的一生狗與鹿 x 六指淵 Huber 最新短篇動畫~~~~ 【狗與鹿IG】 : mydeerdog https://instagram.com/mydeerdog/合作頻道 : 台灣達人秀插畫</p>Posted by <a href="https://www.facebook.com/MYDEERDOG">狗與鹿</a> on Monday, April 13, 2015</blockquote></div></div><p>　在每一個毛小孩心中，牠的主人都是最棒最厲害的，所以別輕易拋棄任何一個毛小孩，牠們都是寶貴的生命。</p><p>&nbsp;</p><p>五、外部連結</p><ol><li><a href="http://line.me/S/sticker/1188327">LINE原創貼圖</a></li></ol><p><img style="max-width: 100%;" src="image_11.jpg" alt="" width="621" height="100%" img_index="11"></p><p>　狗與鹿的各種特色圖畫，在LINE原創貼圖也能夠買得到，這樣跟朋友聊天的過程中就能夠看到可愛的毛小孩們，讓聊天也能夠很溫馨又窩心。</p><p>&nbsp;</p><ol start="2"><li><a href="http://www.spp.com.tw/event/live/2015-mydeerdog/index.htm#b">毛起來愛上你</a></li></ol><p><img style="max-width: 100%;" src="image_12.jpg" alt="" width="450" height="100%" img_index="12"></p><p>　狗與鹿的經典作品集結成《毛起來愛上你》，網路插畫家紅到要出書可是要一段時間的累積，但短短半年就累積26萬粉絲按讚，到現在很少人不知道這位有愛心又有實力的插畫家，出了書就讓粉絲們掏出錢包支持。</p><p>&nbsp;</p><p>看更多的經典作品</p><p>動畫合集(一)：</p><p>動畫合集(二)：</p><p>插畫合集(一)：</p>', '2015-10-16 10:25:30'),
