(1909, 161, 0, 0, 174, '', '{}', '{}', 'pagicon.jpg', 32, 0, 4, '["鹿人","搞笑","諧音梗","插畫家","插畫精選"]', '【鹿人】插畫精選(二)：獵奇的歐巴！', '', 0, '<p style="text-align: center;">1.一秒變獵奇的歐巴。</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015114556134950.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.怎麼看久了有點可愛？</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015114556139137.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.隨處都可以放傘哦～</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015114556155862.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.關於肚臍的由來</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015114556168232.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">5.智者與智障似乎只有一線之隔？</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015114556160782.jpg" alt="" width="350" height="100%" data-pos="page"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">6.小智吃飽後就…</p><p style="text-align: center;"><img style="max-width: 100%;" src="ttshow/account/161/Original/20151015114556420588.png" alt="" width="350" height="100%" data-pos="page"></p>', '2015-10-15 10:55:17'),
(1906, 161, 0, 0, 75, '', '{"0":"20151029084430484204.jpg","1":"20151029084430486209.jpg","2":"20151029084430487318.jpg","3":"20151029084430488305.jpg","4":"20151029084430489252.jpg","5":"20151029084430490129.jpg"}', '{}', 'pagicon.jpg', 36, 0, 4, '["蛋事","插畫家","插畫精選","生活","搞笑"]', '【蛋事】插畫精選(二)：關於女友與朋友的差別？', '', 0, '<p style="text-align: center;">&nbsp;1.對象：女友</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_0.jpg" alt="" width="350" height="100%" img_index="0"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">2.對象：朋友</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_1.jpg" alt="" width="350" height="100%" img_index="1"></p><p style="text-align: center;">潛意識的差別待遇啊。</p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.關於朋友A到底近視多深？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_2.jpg" alt="" width="350" height="100%" img_index="2"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.身為哥哥，就是要盡到保護妹妹的責任！</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_3.jpg" alt="" width="350" height="100%" img_index="3"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">3.你餓了嗎？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">4.到底誰才是敵人呢？</p><p style="text-align: center;"><img style="max-width: 100%;" src="image_5.jpg" alt="" width="350" height="100%" img_index="5"></p>', '2015-10-15 09:46:24'),
(1904, 163, 0, 0, 171, '', '{"0":"20151023102259488477.png","1":"20151023102259489930.jpg","2":"20151023102259490981.jpg","3":"20151023102259491739.png","4":"20151023102259492476.jpg","5":"20151023102259493250.png","6":"20151023102259494121.png","7":"20151023102259494854.jpg","8":"20151023102259495626.jpg","9":"20151023102259496331.jpg","10":"20151023102259496955.jpg","11":"20151023102259497716.jpg","12":"20151023102259498536.png","13":"20151023102259499318.png"}', '{"0":"https://www.youtube.com/embed/ycexcet9yJQ"}', 'pagicon.jpg', 35, 0, 46, '[]', '【插畫名人堂】Onion man畫給你他眼中的人事物', '', 0, '<p><img style="max-width: 100%;" src="image_0.png" alt="" width="620" height="100%" img_index="0"></p><p>&nbsp;</p><p>一、基本資料</p><p><img style="max-width: 100%;" src="image_1.jpg" alt="" width="450" height="100%" img_index="1"></p><p><img style="max-width: 100%;" src="image_2.jpg" alt="" width="501" height="100%" img_index="2"></p><p>名稱：Onion man</p><p>國籍／居住地／原籍：台灣</p><p>Facebook年資：2014年4月1日 – 至今</p><p>粉絲人數：383,810人 (截至151014)</p><p>&nbsp;</p><p>Facebook 帳號： <a href="https://www.facebook.com/onionman4704/">onionman4704</a></p><p>Instagram帳號： <a href="https://instagram.com/onionman__/">onionman__</a></p><p>&nbsp;</p><p>二、簡介</p><p>&nbsp;<img style="max-width: 100%;" src="image_3.png" alt="" width="350" height="100%" img_index="3"></p><p>　↑最原始的洋蔥。</p><p><img style="max-width: 100%;" src="image_4.jpg" alt="" width="350" height="100%" img_index="4"></p><p>　Onion man(以下稱洋蔥)是剛從大學畢業的大學生，洋蔥作品出現的人物是以國小同學為原型塑造，從自己看到各種生活上的人事物，再進化成讓網友投稿再畫出各種好笑的梗。洋蔥打算以後朝著專職的插畫家發展，讓大家看到他更多的作品，也能夠從臉書粉專這個小平台得到開心的來源。</p><p>&nbsp;</p><p>三、插畫風格</p><p>&nbsp;<img style="max-width: 100%;" src="image_5.png" alt="" width="350" height="100%" img_index="5"></p><p>　↑既然要耍廢就幸福放鬆的耍廢吧。</p><p><img style="max-width: 100%;" src="image_6.png" alt="" width="350" height="100%" img_index="6"></p><p>　↑漫畫裡面的都不是真的，隨便割到明明就痛死了。</p><p><img style="max-width: 100%;" src="image_7.jpg" alt="" width="350" height="100%" img_index="7"></p><p>　↑想想比自己不好的，結果心情就好了。</p><p>　從日常生活中看得到的每一件小事，把它變成有趣讓大家有共鳴的作品，除了會心一笑之外，更讓不愉快的事情都一起掃光。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_8.jpg" alt="" width="500" height="100%" img_index="8"></p><p>　↑有時候掛心一個人，就是會在意到睡不著。</p><p><img style="max-width: 100%;" src="image_9.jpg" alt="" width="500" height="100%" img_index="9"></p><p>　↑努力是為了自己，但大家常常都不自覺地為了別人而努力。</p><p>　人不應該妄自菲薄，把別人的眼光當作最重要的，洋蔥用詼諧的方式告訴粉絲們要更多愛自己，不是一直為了別人而活。</p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_10.jpg" alt="" width="350" height="100%" img_index="10"></p><p>　↑虛幻的世界得到的安慰不能代表什麼。</p><p><img style="max-width: 100%;" src="image_11.jpg" alt="" width="350" height="100%" img_index="11"></p><p>　↑秘密永遠都會默默地變成大家知道的秘密。</p><p>　無論是朋友、情侶間都會發生各種不同的狀況，洋蔥把他看到的現象畫出來，讓大家從他的眼睛看到的東西想想和笑笑。</p><p>&nbsp;</p><p>四、熱門影音作品</p><p>&nbsp;</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/onionman4704/videos/vb.845235362169557/1152910148068742/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/onionman4704/videos/1152910148068742/"><p>這...太恐怖了吧合作頻道:台灣達人秀插畫粉絲 宏彬提供快追蹤搜尋洋蔥IG:onionman__</p>Posted by <a href="https://www.facebook.com/onionman4704">Onion man</a> on Sunday, July 12, 2015</blockquote></div></div><p>&nbsp;</p><p>　↑「將會」、「江蕙」傻傻分不清楚？百萬粉絲看過覺得也太可怕了吧~</p><p>&nbsp;</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/onionman4704/videos/vb.845235362169557/1139990319360725/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/onionman4704/videos/1139990319360725/"><p>哥的異性緣實在太好了合作頻道:台灣達人秀插畫謝謝偶像 Gem Tang粉絲 政益提供</p>Posted by <a href="https://www.facebook.com/onionman4704">Onion man</a> on Sunday, July 5, 2015</blockquote></div></div><p>&nbsp;</p><p>　↑讓「黑鳳梨」走紅的影片就出自洋蔥的筆下，觀看次數高達3百多萬。</p><p>&nbsp;</p><div id="fb-root">&nbsp;</div><div class="fb-video" data-allowfullscreen="1" data-href="/onionman4704/videos/vb.845235362169557/1114835245209566/?type=3"><div class="fb-xfbml-parse-ignore"><blockquote cite="https://www.facebook.com/onionman4704/videos/1114835245209566/"><p>一起擺脫糜爛的大學生活!!! 看完整MV : http://j.mp/1bOVk9Z什麼是U25? : http://j.mp/1JcBtPx以下開放留言 你能做到幾項?</p>Posted by <a href="https://www.facebook.com/onionman4704">Onion man</a> on Tuesday, May 19, 2015</blockquote></div></div><p>&nbsp;</p><p>　↑當過大學生的看了影片一定超有戚戚焉，沒當過大學生的看了也可以身歷其境，超真實地一起擺脫糜爛大學生活吧！</p><p>&nbsp;</p><p>五、外部連結</p><p>&nbsp;</p><ol><li><a href="https://store.line.me/stickershop/product/1118750/zh-Hant">LINE原創貼圖</a></li></ol><p>&nbsp;<img style="max-width: 100%;" src="image_12.png" alt="" width="350" height="100%" img_index="12"></p><p>&nbsp;</p><p><img style="max-width: 100%;" src="image_13.png" alt="" width="350" height="100%" img_index="13"></p><p>&nbsp;</p><p>&nbsp;</p><ol start="2"><li><a href="https://www.youtube.com/watch?v=ycexcet9yJQ">網路溫度計-插畫部落客</a></li></ol><p><div class="youtobe_video" style=""><div style="max-width: 100%; width:560px; position: relative; float: none" name="u2_player"><iframe src="//www.youtube.com/embed/ycexcet9yJQ" mmtype="[''youtube'']" key="video" mmid="1" style="border: none; margin-left: auto; margin-right: auto; height: 100%; width:100%;"></iframe></div></div></p><p>&nbsp;</p><p>看更多Onion man的經典作品</p><p>動畫合集(一)：</p><p>動畫合集(二)：</p><p>插畫合集(一)：</p>', '2015-10-15 08:23:26');
